INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('4', '3', 'Uber uns', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Der Hersteller TM „Ksena“&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Salon Hochzeitskleider „Ksena“&lt;/strong&gt;Arbeitet schon 7 Jahre in Ukraine und 20-Land der Europäischen Union und der GUS dargestellt. Wir arbeiten direkt mit Bräute und Großhandelskunden. Das Ziel unseres Salons ist die Schaffung von exklusiven Kleidern, die jede Braut unwiderstehlich machen werden. Unser Kleid ist eine Kombination aus Qualität, Komfort und Schönheit zu einem vernünftigen Preis. In unserer Arbeit, Wir halten sich nicht nur auf die modernen Trends, wir diktieren den Trend selber.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Wir verwenden nur qualitative Tücher, Werkzeuge und dekorative Elemente. Alle Kleider \'trimmen mit Spitze, Edelsteine und Strass ist nur von Hand gemacht. Die Schärfe vieler Modelle ist handgefertigte Stickerei und exklusive Schnürsenkel.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Unsere Kleider sind die beste Wahl für Bräute, die sehen wollen, atemberaubend auf ihrem Fest und an diesen Tag für immer erinnern.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Für Großkunden bieten wir nur die besten Varianten an, die nicht nur Geld verdienen, sondern auch das Absatzniveau und die Popularität auf einem lokalen Markt erhöhen.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Fertigungsunternehmen TM «Ksena» - ist Ihr zuverlässiger Partner auf dem Markt.&lt;/strong&gt;&lt;/p&gt;');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('4', '1', 'About Us', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Manufacturing company TM «Ksena»&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;The wedding salon «Ksena»&lt;/strong&gt;works atUkraine’s, CIS’s countries’ and Europe’s market more than 7 years.We work directly with brides and wholesale buyers. The main purpose of our salon is creation of exclusive dresses in which every bride will feel herself irresistible. Our gowns are combination of quality, convenience and beauty in a reasonable price. In our work we not only follow modern trends – we establish them on our own, too.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;We use only qualitative cloths, implement and decorative elements. All dresses’ trimming with lace, gems and rhinestones is made only by hand. The zest of many models is handmade embroidery and exclusive laces.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Our dresses are the best choice for brides who want to look stunning on their feast and to remember this day forever.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;For wholesale clients we offer only the best variants that help not only to make money, but to raise the level of sellings and popularity on a local market.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Manufacturing company TM «Ksena» - is Your reliable partner on the market.&lt;/strong&gt;&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('4', '2', 'О нас', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Компания производитель ТМ &quot;Ксена&quot;&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Салон свадебных платьев &quot;Ксена&quot;&amp;nbsp;&lt;/strong&gt;работает на рынке Украины, стран СНГ и Европы уже более 7 лет. Мы работаем и напрямую с невестами и с оптовыми покупателями. Цель нашего салона это создание эксклюзивных платьев, в которых каждая невеста будет чувствовать себя неотразимой. Наши платья это сочетание качества, удобства и красоты по разумной цене. В своей работе мы не просто придерживаемся современных тенденций, мы сами их устанавливаем.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Мы используем только &amp;nbsp;качественные ткани, фурнитуру и декоративные элементы. Отделка всех платьев кружевами, камнями и стразами &amp;nbsp;выполняется только вручную. Изюминкой многих моделей является ручная вышивка и эксклюзивные кружева.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Наши платья &amp;nbsp;лучший выбор для невест, которые хотят выглядеть сногсшибательно на своем празднике и запомнить этот день навсегда.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Для оптовых клиентов мы предлагаем лучшие варианты, которые позволяют не просто зарабатывать деньги, а поднять уровень продаж и популярности на локальном рынке.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Компания производитель ТМ &quot;Ксена&quot; - Ваш надежный партнер на рынке.&lt;/strong&gt;&lt;/p&gt;\r\n');
