INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('7', '3', 'Artikel', '&lt;div aria-multiselectable=&quot;true&quot; class=&quot;panel-group&quot; id=&quot;accordion&quot; role=&quot;tablist&quot;&gt;\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingOne&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseOne&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseOne&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Maßanfertigung&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingOne&quot; class=&quot;panel-collapse collapse in&quot; id=&quot;collapseOne&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Liebe Braut, bieten Maßanfertigungen nach Ihren Messungen! Wir arbeiten seit 2009 und haben große Erfahrung im Bereich der Schneiderei Brautkleider! Mehr als 5.000 Bräute wurden glücklich, weil von uns! Was ist gut) Gerne bieten wir Ihnen günstige Preise und eine überraschend hohe Qualität! Adresse: Chernivtsi, ul.Glavnaya 29 Rufen Sie uns an! (050) 105-03-55&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingTwo&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseTwo&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseTwo&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Kuchenfiguren&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingTwo&quot; class=&quot;panel-collapse collapse&quot; id=&quot;collapseTwo&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Traditionelle Dekoration der Hochzeitstorte-Figuren, die die Braut und den Bräutigam symbolisieren. Bei der Auswahl der Zahlen sollte das Gewicht der Zusammensetzung und Größe des Kuchens zu berücksichtigen. Zum Beispiel auf einem großen Kuchen kleine Figur würde lächerlich aussehen, und ein Kuchen mit Sahne verziert, kann einfach nicht aufrechterhalten die massive Statue. Sehr populäre humorvolle und freche Bilder.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('7', '1', 'Articles', '&lt;div aria-multiselectable=&quot;true&quot; class=&quot;panel-group&quot; id=&quot;accordion&quot; role=&quot;tablist&quot;&gt;\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingOne&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseOne&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseOne&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Custom tailoring&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingOne&quot; class=&quot;panel-collapse collapse in&quot; id=&quot;collapseOne&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Dear Bride, offer custom tailoring according to your measurements! We have been working since 2009 and have vast experience in the field of tailoring wedding dresses! More than 5,000 brides became happy because of us! What is good) We will be glad to offer you reasonable prices and a surprisingly high-quality! Address: Chernivtsi, ul.Glavnaya 29 Call us! (050) 105-03-55&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingTwo&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseTwo&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseTwo&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Cake figurines &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingTwo&quot; class=&quot;panel-collapse collapse&quot; id=&quot;collapseTwo&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Traditional decoration of the wedding cake figurines, symbolizing the bride and groom. When choosing figures should take into account the weight of the composition and size of the cake. For example, on a large cake small figure would look ridiculous, and a cake decorated with cream, can simply not sustain the massive statue. Very popular humorous and naughty images.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('9', '1', 'Partners', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Reliability, quality, experience&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong&gt;Salon wedding dresses &quot;Xena&quot;&lt;/strong&gt; works in the market of Ukraine, CIS countries and Europe for over 7 years. We work directly with brides and wholesale customers. The purpose of our salon is the creation of exclusive dresses, which every bride will feel irresistible. Our dress is a combination of quality, comfort and beauty at a reasonable price. In our work we do not just stick to modern trends, we set them ourselves.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nWe use only high quality fabrics, accessories and decorative items. Finish all the dresses with lace, sequins and stones is done by hand. The highlight of many models is the &lt;strong&gt;exclusive hand embroidery and lace&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nOur dresses are the best choice for brides who want to look stunning on your holiday and remember this day forever.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nFor wholesale customers we offer the best options that allow you to not only make money, but to raise the level of sales and popularity on the local market.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\n&lt;strong&gt;The manufacturer TM &quot;Xena&quot; - your reliable partner in the market.&lt;/strong&gt;&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('5', '3', 'Terms &amp; Conditions', '&lt;p&gt;\r\n\tTerms &amp;amp; Conditions&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('3', '3', 'Privacy Policy', '&lt;p&gt;\r\n\tPrivacy Policy&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('6', '3', 'Delivery Information', '&lt;p&gt;\r\n\tDelivery Information&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('9', '3', 'Partner', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Zuverlässigkeit, Qualität, Erfahrung&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong&gt;Salon Brautkleider &quot;Xena&quot;&lt;/strong&gt; arbeitet auf dem Markt der Ukraine, GUS-Länder und Europa für mehr als 7 Jahren. Wir arbeiten direkt mit Bräuten und Großkunden. Der Zweck unseres Salons ist die Schaffung von exklusiven Kleider, die jede Braut fühlen unwiderstehlich. Unser Kleid ist eine Kombination aus Qualität, Komfort und Schönheit zu einem vernünftigen Preis. In unserer Arbeit halten wir uns nicht nur an modernen Trends fest, sondern setzen uns selbst ein.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nWir verwenden nur hochwertige Stoffe, Accessoires und Dekorationsartikel. Beenden Sie alle Kleider mit Spitze, Pailletten und Steine wird von Hand gemacht. Das Highlight vieler Modelle ist &lt;strong&gt;die exklusive Handstickerei und Spitze&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nUnsere Kleider sind die beste Wahl für Bräute, die sehen wollen, atemberaubend auf Ihren Urlaub und erinnere mich an diesen Tag für immer.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nFür Großkunden bieten wir Ihnen die besten Möglichkeiten, nicht nur Geld zu verdienen, sondern auch den Absatz und die Popularität auf dem lokalen Markt zu erhöhen.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\n&lt;strong&gt;Der Hersteller TM &quot;Xena&quot;&lt;/strong&gt; - Ihr zuverlässiger Partner auf dem Markt.&lt;/p&gt;');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('9', '4', 'Партнерам', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Надійність, якість, досвід&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong&gt;Салон весільних суконь &quot;Ксена&quot;&lt;/strong&gt; працює на ринку України, країн СНД і Європи вже понад 7 років. Ми працюємо і безпосередньо з нареченими та з оптовими покупцями. Мета нашого салону це створення ексклюзивних суконь, в яких кожна наречена буде відчувати себе чарівною. Наші сукні це поєднання якості, зручності і краси за розумною ціною. У своїй роботі ми не просто дотримуємося сучасних тенденцій, ми самі їх встановлюємо.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nМи використовуємо тільки якісні тканини, фурнітуру та декоративні елементи. Оздоблення всіх суконь мереживами, каменями і стразами виконується тільки вручну. Родзинкою багатьох моделей є ручна вишивка і &lt;strong&gt;ексклюзивні мережива&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nНаші сукні кращий вибір для наречених, які хочуть виглядати надзвичайно на своєму святі і запам\'ятати цей день назавжди.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nДля оптових клієнтів ми пропонуємо найкращі варіанти, які дозволяють не просто заробляти гроші, а підняти рівень продажів і популярності на локальному ринку.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\n&lt;strong&gt;Компанія виробник ТМ &quot;Ксена&quot;&lt;/strong&gt; - Ваш надійний партнер на ринку.&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('7', '2', 'Статьи', '&lt;div aria-multiselectable=&quot;true&quot; class=&quot;panel-group&quot; id=&quot;accordion&quot; role=&quot;tablist&quot;&gt;\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingOne&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseOne&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseOne&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Пошив под заказ&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingOne&quot; class=&quot;panel-collapse collapse in&quot; id=&quot;collapseOne&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Дорогие невесты, предлагаем Вам пошив под заказ по вашим меркам! Мы работаем с 2009 года и имеем огромный опыт в сфере индивидуального пошива свадебных платьев! Более 5000 невест стали счастливы благодаря нам! Что не может не радовать)&lt;br /&gt;\r\nМы будем рады предлагать Вам приятные цены и удивительно-высокое качество!&lt;br /&gt;\r\nАдрес: г. Черновцы, ул.Главная 29&amp;nbsp;&lt;br /&gt;\r\nЗвоните! (050) 105-03-55&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingTwo&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseTwo&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseTwo&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Статуэтки для торта &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingTwo&quot; class=&quot;panel-collapse collapse&quot; id=&quot;collapseTwo&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Традиционное украшение свадебного торта статуэтки, символизирующие новобрачных. При выборе фигурки следует учитывать вес, состав и размер торта. К примеру, на большом торте маленькая фигурка будет смотреться нелепо, а торт, украшенный сливками, может просто не выдержать массивную статуэтку. Большой популярностью пользуются юмористические и озорные образы.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('7', '4', 'Статті', '&lt;div aria-multiselectable=&quot;true&quot; class=&quot;panel-group&quot; id=&quot;accordion&quot; role=&quot;tablist&quot;&gt;\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingOne&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseOne&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseOne&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Пошиття під замовлення&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingOne&quot; class=&quot;panel-collapse collapse in&quot; id=&quot;collapseOne&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Дорогі наречені, пропонуємо Вам пошиття під замовлення за вашими мірками! Ми працюємо з 2009 року і маємо величезний досвід в сфері індивідуального пошиття весільних суконь! Більше 5000 наречених стали щасливі завдяки нам! Що не може не радувати)&lt;br /&gt;\r\nМи будемо раді запропонувати Вам приємні ціни і дивовижно-високу якість!&lt;br /&gt;\r\nАдреса: м. Чернівці, вул. Головна 29&amp;nbsp;&lt;br /&gt;\r\nТелефонуйте! (050) 105-03-55&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;panel panel-default&quot;&gt;\r\n&lt;div class=&quot;panel-heading&quot; id=&quot;headingTwo&quot; role=&quot;tab&quot;&gt;&lt;a aria-controls=&quot;collapseTwo&quot; aria-expanded=&quot;false&quot; class=&quot;collapsed&quot; data-parent=&quot;#accordion&quot; data-toggle=&quot;collapse&quot; href=&quot;http://oc1564/index.php?route=information/information&amp;amp;information_id=7#collapseTwo&quot; role=&quot;button&quot; style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 30px;&quot;&gt;Статуетки для торта&lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div aria-labelledby=&quot;headingTwo&quot; class=&quot;panel-collapse collapse&quot; id=&quot;collapseTwo&quot; role=&quot;tabpanel&quot;&gt;\r\n&lt;div class=&quot;panel-body&quot;&gt;\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Традиційна прикраса весільного торту статуетки, що символізують молодят. При виборі фігурки слід враховувати вагу, склад і розмір торту. Наприклад, на великому торті маленька фігурка буде виглядати безглуздо, а торт, прикрашений вершками, може просто не витримати масивну статуетку. Великою популярністю користуються гумористичні і пустотливі образи.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('5', '4', 'Terms &amp; Conditions', '&lt;p&gt;\r\n\tTerms &amp;amp; Conditions&lt;/p&gt;\r\n');
