INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('6', '4', 'Delivery Information', '&lt;p&gt;\r\n\tDelivery Information&lt;/p&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('4', '4', 'Про нас', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;font-weight: lighter; box-sizing: border-box; margin: 0.67em 0px;&quot;&gt;Компанія виробник ТМ &quot;Ксена&quot;&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Салон весільних суконь &quot;Ксена&quot;&amp;nbsp;&lt;/strong&gt;працює на ринку України, країн СНД і Європи вже понад 7 років. Ми працюємо і безпосередньо з нареченими та з оптовими покупцями. Мета нашого салону це створення ексклюзивних суконь, в яких кожна наречена буде відчувати себе чарівною. Наші сукні це поєднання якості, зручності і краси за розумною ціною. У своїй роботі ми не просто дотримуємося сучасних тенденцій, ми самі їх встановлюємо.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Ми використовуємо тільки &amp;nbsp;якісні тканини, фурнітуру та декоративні елементи. Оздоблення всіх суконь мереживами, каменями і стразами &amp;nbsp;виконується тільки вручну. Родзинкою багатьох моделей є ручна вишивка і ексклюзивні мережива.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Наші сукні &amp;nbsp;кращий вибір для наречених, які хочуть виглядати надзвичайно на своєму святі і запам\'ятати цей день назавжди.&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;Для оптових клієнтів ми пропонуємо найкращі варіанти, які дозволяють не просто заробляти гроші, а підняти рівень продажів і популярності на локальному ринку.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: &amp;quot;Open Sans&amp;quot;, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong style=&quot;box-sizing: border-box;&quot;&gt;Компанія виробник ТМ &quot;Ксена&quot; - Ваш надійний партнер на ринку.&lt;/strong&gt;&lt;/p&gt;\r\n&lt;/center&gt;\r\n');
INSERT INTO `ocksena_information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('9', '2', 'Партнерам', '&lt;center style=&quot;box-sizing: border-box; color: rgb(0, 0, 0); font-family: MyriadProCondRegular, sans-serif, arial; font-size: 21px;&quot;&gt;\r\n&lt;h1 style=&quot;box-sizing: border-box; margin: 0.67em 0px; font-weight: lighter;&quot;&gt;Надежность, качество, опыт&lt;/h1&gt;\r\n&lt;/center&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;strong&gt;Салон свадебных платьев &quot;Ксена&quot;&lt;/strong&gt; работает на рынке Украины, стран СНГ и Европы уже более 7 лет. Мы работаем и напрямую с невестами и с оптовыми покупателями. Цель нашего салона это создание эксклюзивных платьев, в которых каждая невеста будет чувствовать себя неотразимой. Наши платья это сочетание качества, удобства и красоты по разумной цене. В своей работе мы не просто придерживаемся современных тенденций, мы сами их устанавливаем.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nМы используем только качественные ткани, фурнитуру и декоративные элементы. Отделка всех платьев кружевами, камнями и стразами выполняется только вручную. Изюминкой многих моделей является ручная вышивка и &lt;strong&gt;эксклюзивные кружева&lt;/strong&gt;.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nНаши платья лучший выбор для невест, которые хотят выглядеть сногсшибательно на своем празднике и запомнить этот день навсегда.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\nДля оптовых клиентов мы предлагаем лучшие варианты, которые позволяют не просто зарабатывать деньги, а поднять уровень продаж и популярности на локальном рынке.&lt;/p&gt;\r\n\r\n&lt;p style=&quot;box-sizing: border-box; font-family: Open Sans, sans-serif, arial; font-size: 18px; color: rgb(0, 0, 0); text-align: justify;&quot;&gt;&lt;br /&gt;\r\n&lt;strong&gt;Компания производитель ТМ &quot;Ксена&quot;&lt;/strong&gt; - Ваш надежный партнер на рынке.&lt;/p&gt;\r\n');
