INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('51', '1', 'Perla', '&lt;p&gt;Exclusive wedding dresses are represented in 2015 collection by the wedding salon «Ksena».&lt;/p&gt;\r\n\r\n&lt;p&gt;The dress «Perla» - is a gem in this model series.&lt;/p&gt;\r\n\r\n&lt;p&gt;A snow-white dress with an opulent skirt, open back and small train immediately attracts people’s attention. This wedding custom-designed dress will excite girl, who dreams to feel herself like a princess on the first ball.&lt;/p&gt;\r\n\r\n&lt;p&gt;The dress has a classical cutout garment with a close-fitting in the waist corset and opulent multilayer skirt. The heart-shaped bodice accents woman’s breasts in a good way. At the top of the corset the cloth transfers into limpid netting the edges of which are wrought with pearls.&lt;/p&gt;\r\n\r\n&lt;p&gt;The dress «Perla»is made with shoulder-straps, without sleeves with a bateau neck cutout. The whole corset is covered with intricate patterns made of pearls with inclusion of gemstones.&lt;/p&gt;\r\n\r\n&lt;p&gt;A special appeal of this wedding dress – is the back: behind the corset has a deep V-shaped &amp;nbsp;cutout which is closed with netting and a small train. At the back the dress zips up with buttons, which forms a solid line that creates an additional accent, attracting gazes to the back.&lt;/p&gt;\r\n\r\n&lt;p&gt;A big amount of semi-transparent layers of tulle without additional decoration gives necessary pomp and weightlessness to the dress.&lt;/p&gt;\r\n\r\n&lt;p&gt;Such dress will fit to the possessors of graceful backs and girls whose character has a part of adventurism. An elegant and modest classic of cutting-out on the one side and tempting enigma on the other – that is a choice of plucky and stylish fiancées.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('52', '1', 'Mishel', '&lt;p&gt;In the wedding salon «Ksena»You can buy a wedding dress «Mishel». Representedattire has a marvelous external look and will fit in any wedding, having made You the bride, who always will be remembered.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;A-line’s dress &quot;Michel&quot; is made in a milky colour. The main feature of the cut of such wedding dress is that strikingly narrow top does not constrict, but visually stretches the figure of the bride.&lt;/p&gt;\r\n\r\n&lt;p&gt;The heart-shaped bodice will make a bright accent in decollete zone, and a sleeveless open top will emphasize the bride’s graceful arms and shoulders. Embroidered with stones and decorated with hand-embroidered the corset gracefully turns into middle-splendor skirt of tulle.&lt;/p&gt;\r\n\r\n&lt;p&gt;Handmade embroidery is an interesting décor for skirt, which will give gracefulness to the image. Trim embroidery is perfectly combined with a smooth cut, laying stress on the elegance of the bride\'s figure, adding her femininity and sensuality. Such kind of wedding dresses wear beautiful princesses of Hollywood movies, so why do not You choose A-line’s dress for Your own celebration?&lt;/p&gt;\r\n\r\n&lt;p&gt;The combination of all the elements of the wedding decorations creates a real harmony in the bride’s image, which is especially important at a wedding party. The wedding salon «Ksena»gives you an opportunity to purchase a wedding dress of such kind of model or have it tailored.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('54', '3', 'Nicol', '&lt;p&gt;Sie müssen nicht Ihr Hochzeitskleid in Eile wählen. Am Haupttag eines jeden Brautlebens sollte alles perfekt sein, und das Wichtigste - sie sollte sich charmant fühlen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Es gibt ein Kleid &quot;Nicol&quot; in der Sammlung der Brautkleider im Salon &quot;Ksena&quot;, die ein Gefühl der Unwiderstehlichkeit und Attraktivität für jedes Mädchen geben wird. Dieses festliche Kleid, das die Verkörperung von Schönheit und Zärtlichkeit ist, verziert die Braut.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Oberseite des Kleides ist geöffnet und konzentriert Aufmerksamkeit auf die Braut decollete Zone, Ansatz und Schulterlinie; Sie betont ihre Verfeinerung. Das offene Mieder ist mit handgefertigten Stickereien und Perlen verziert, die die Aufmerksamkeit auf das Bild der Braut ziehen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das Korsett ist eng anliegend in der Taille und ist in perfekter Harmonie mit dem üppigen mehrschichtigen Rock aus Tüll. Hinter dem Rock glatt verwandelt sich in eine schicke Spur, die das Bild Helligkeit und Anmut gibt. Die Unterseite und die Oberseite des Rockes werden mit breiter handgemachter Spitze verziert, die mit Kornen getrimmt wird, die der Kleidung Eleganz und Zierlichkeit gibt.&lt;/p&gt;\r\n\r\n&lt;p&gt;Der Hochzeitssalon «Ksena» gibt Ihnen die Gelegenheit, ein &quot;Nicol&quot; Kleid zu kaufen oder eine andere exklusive Brautkleider für Ihren besonderen Tag auszuwählen. Wir helfen Ihnen gerne, Ihren Urlaub in ein Märchen zu verwandeln!&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('53', '3', 'Caramel', '&lt;p&gt;Ein Hochzeitssalon &quot;Ksena&quot; bietet eine exklusive Kollektion von Brautkleidern aus dem Jahr 2016 an. In diesem Bereich finden Sie noble Brautkleider, in denen Sie nicht nur gut aussehen, werden sie fühlen Sie sich wie eine Königin - schön, elegant und wünschenswert.&lt;/p&gt;\r\n\r\n&lt;p&gt;&quot;Caramel&quot; Kleid ist ideale Variante für Mädchen, die für klassische Hochzeitskleidung suchen. Dieses maßgeschneiderte Brautkleid passt all diese Anforderungen und noch mehr.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die erste Eigenschaft des Kleides - ist die Farbe Kerbe. Entwerfer haben eine Kombination der weißen und Karamellfarben verwendet. Solch nicht zu starker Kontrast schaut sanft, nicht auffällig. Es ist ganz die Sache, die Gäste denken: &quot;Oh, wie ungewöhnlich und schön es ist&quot; und genau erinnern Sie sich und Ihre Hochzeit.&lt;/p&gt;\r\n\r\n&lt;p&gt;Zusätzliche Aufmerksamkeit auf Sie und Ihre Kleidung bietet die folgenden Designer-Akzent-eine handgemachte Spitze. Es wird verwendet, um die Unterseite des Rockes und des Korsetts zu trimmen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eine üppige Karamell Rock näher an den Boden ist mit einem breiten Streifen von Spitze mit einem ungewöhnlichen Muster verziert. Ein kleiner Zug fügt ein ganzes Bild eine königliche Größe hinzu. Leichte Tücher, die für das Nähen des Rockes verwendet werden, nach unten mit schönen Falten, Hinzufügen eines gewünschten Volumen, nicht wiegt das ganze Kleid.&lt;/p&gt;\r\n\r\n&lt;p&gt;Korsett dieses Modells verdient eine besondere Aufmerksamkeit - geschlossen, eng anliegend in der Taille mit einem eleganten bateau Halsausschnitt. Es betont die Braut Schönheit und Weiblichkeit. Das ganze Korsett und die langen Ärmel sind mit einer weißen Spitze verziert.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eine kleine Schleife, die in zwei Farben hergestellt wird, vervollständigt diese ungewöhnliche Kleidung. So ein kleiner verspielter Oberton in diesem eleganten, teuren und atemberaubenden Kleid.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('56', '3', 'Camelia', '&lt;p&gt;Luxuriöse Brautkleider aus dem Salon &quot;KSENA&quot; machen ein reichhaltiges Sortiment, aus dem Sie das Brautkleid für jeden Geschmack und Geldbeutel wählen können.&lt;/p&gt;\r\n\r\n&lt;p&gt;Modell &quot;Camelia&quot; zeigt Bescheidenheit, Unschuld und Zärtlichkeit in Form, Stoff und Dekor. Der Klassiker der Hochzeitsart und weise ist Ballsaal-Schattenbild, das jede mögliche Zahl schmückt und es feminin und empfindlich bildet.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die schneeweiße Reinheit des Korsetts wird mit Zierspitzen, mit Perlen und Perlen verkleidet, hervorgehoben. Schöne figured Ausschnitt zieht die Blicke auf die nackten anmutigen Hals und dünne Schultern. Lace Ärmel verstärken nur den Eindruck und konzentrieren die Aufmerksamkeit auf leicht fallende Taille Linie.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das Hochzeits-Kleid &quot;Camelia&quot; unterscheidet sich mit einem sehr üppigen Rock mit einem Zug von mittlerer Länge. Eine riesige Anzahl von Schichten aus Tüll und matte harte Euro-Gitter bieten eine schicke Volumen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Der Hochzeitssalon &quot;KSENA&quot; bietet Bräuten eine riesige Anzahl von wunderschönen Brautkleider, die ihren Look unwiderstehlich und beeindruckend.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('57', '3', 'Nimfa', '&lt;p&gt;Der Hochzeitssalon «Ksena» hat ein exklusives Angebot für Bräute - ein maßgeschneidertes Brautkleid »Nimfa«, vorbereitet.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dieses Brautkleid erstaunt alle Bräute mit seiner Pracht und Raffinesse. Eine exquisite A-Linie unterstreicht die Zerbrechlichkeit und Eleganz der Braut. Schneeweißes Kleid erinnert an die Unschuld und Zärtlichkeit eines in ihm gekleideten Mädchens. Ein dünner Satin-Gürtel macht die Taille schmaler und subtiler.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eine enge Passform im Taillen-Satin-Korsett verwandelt sich sanft in den mittelglatten Tüllrock, der mit einem langen, breiten Zug verziert ist. Die Spitze des Kleides ist mit einem Spitze Tuch, bestickt mit Perlen, Perlen und Pailletten bedeckt. Die mittlere Hülse und ein kleiner Ausschnittausschnitt konzentrieren Aufmerksamkeit auf dünne Handgelenke, Schultern und Ansatz.&lt;/p&gt;\r\n\r\n&lt;p&gt;Zest der Dekoration ist Volumenblumen, die handgemachte Stickerei mit Kornen und Perlen einschließen. Zarte Blüten bedecken das gesamte Korsett, die Ober- und Unterseite des Rockes. Zusätzlich entlang des unteren Teils gibt es Einsätze mit der gleichen Verwendung von Sträußen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Exklusive Brautkleider &quot;Nimfa&quot; betonen Braut \'soleness und Schönheit, so dass sie wie Königinnen an ihrem besonderen Tag fühlen.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('50', '3', 'Amazonka', '&lt;p&gt;Der Hochzeitssalon «Ksena» bietet klassische Brautkleider, die Verlobte in schöne Prinzessinnen auf dem wichtigsten Fest ihres Lebens verwandeln werden. Das Modell des Kleides «Amazonka» - isattire in einem Ballsaal-Stil in einer weißen Farbe.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die offene Oberseite Enframes und visuell schafft die Linie der Schultern und Arme länger, die das Bild offen, zuversichtlich und effektiv macht. Das herzförmige sinnliche Oberteil wird das Volumen und die Linie der Brüste der Frau gewinnbringend akzentuieren.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das wulstige handgefertigte Korsett, das sich zu einem opulenten Rock verwandelt, verleiht der Taille einen besonderen Stress und macht sie besonders elegant. Ein Volumen luftigen Rock aus ein paar Tüll Gewebe sieht teuer und hat eine erstaunliche Plüsch Zug, der das Bild wunderschön und festlich machen wird.&lt;/p&gt;\r\n\r\n&lt;p&gt;Auf dem bedeutendsten Tag des Lebens ist es für die Verlobte sehr wichtig, in ihr charmant zu sein. «Amazonka» unterstreicht die Eleganz der Figur, Weiblichkeit und Anmut.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('51', '3', 'Perla', '&lt;p&gt;Exklusive Brautkleider sind in der Kollektion 2015 durch den Hochzeitssalon «Ksena» vertreten.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das Kleid «Perla» - ist ein Juwel dieser Modellreihe.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ein schneeweisses Kleid mit opulentem Rock, offenem Rücken und kleinem Zug zieht sofort die Aufmerksamkeit der Leute auf sich. Diese Hochzeit maßgeschneiderte Kleid wird Mädchen begeistern, die träumen, sich wie eine Prinzessin auf dem ersten Ball zu fühlen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das Kleid hat einen klassischen Ausschnitt Kleidungsstück mit einer engen Passform in der Taille Korsett und opulenten mehrschichtigen Rock. Das herzförmige Mieder betont die Brüste der Frau auf eine gute Art und Weise. An der Spitze des Korsetts verwandelt sich das Tuch in ein klares Netz, dessen Kanten mit Perlen geschmückt sind.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das Kleid «Perla» wird mit Schulterriemen, ohne Ärmel mit einem bateau Halsausschnitt gemacht. Das ganze Korsett ist mit komplizierten Mustern aus Perlen mit Einbeziehung von Edelsteinen bedeckt.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ein besonderer Reiz dieses Brautkleides - ist der Rücken: hinter dem Korsett hat einen tiefen V-förmigen Ausschnitt, der mit Netz und einem kleinen Zug geschlossen ist. Auf der Rückseite das Kleid Reißverschlüsse mit Knöpfen, die eine durchgehende Linie, die einen zusätzlichen Akzent schafft bildet, zieht Blicke auf den Rücken.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eine große Menge von halbtransparenten Schichten aus Tüll ohne zusätzliche Dekoration gibt notwendige Pomp und Schwerelosigkeit für das Kleid.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dieses Kleid passt zu den Besitzern von anmutigen Rücken und Mädchen, deren Charakter einen Teil des Abenteurertums hat. Ein eleganter und bescheidener Klassiker des Cut-Outs auf der einen Seite und verlockendes Rätsel auf der anderen - das ist eine Wahl von zierlichen und stilvollen Verlobten.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('52', '3', 'Mishel', '&lt;p&gt;Im Hochzeitssalon «Ksena» Sie können ein Hochzeitskleid «Mishel» kaufen. Representattire hat einen wunderbaren äußeren Blick und wird in jede Hochzeit passen, nachdem Sie die Braut, die immer in Erinnerung bleiben wird.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;A-Linie Kleid &quot;Michel&quot; ist in einer milchigen Farbe gemacht. Das Hauptmerkmal der Schnitt eines solchen Brautkleid ist, dass auffallend schmalen Top nicht verengen, sondern visuell erstreckt sich die Figur der Braut.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das herzförmige Oberteil wird einen hellen Akzent im Dekolleté-Bereich machen, und ein ärmelloses offenes Oberteil wird die anmutigen Arme und Schultern der Braut betonen. Mit Steinen bestickt und mit handgesticktem Korsett verziert, verwandelt sich das Korsett anmutig in einen Mittelprachtrock aus Tüll.&lt;/p&gt;\r\n\r\n&lt;p&gt;Handmade Stickerei ist ein interessantes Dekor für Rock, die Anmut dem Bild geben wird. Trim Stickerei ist perfekt kombiniert mit einem glatten Schnitt, mit Stress auf die Eleganz der Braut Figur, fügte hinzu, ihre Weiblichkeit und Sinnlichkeit. Solche Art von Brautkleidern tragen schöne Prinzessinnen von Hollywood-Filme, also warum nicht Sie wählen A-Linie das Kleid für Ihre eigene Feier?&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Kombination aller Elemente der Hochzeit Dekorationen schafft eine wahre Harmonie in das Bild der Braut, die besonders wichtig ist bei einer Hochzeitsfeier. Der Hochzeitssalon «Ksena» gibt Ihnen die Möglichkeit, ein Hochzeitskleid dieser Art von Modell kaufen oder haben es maßgeschneidert.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('54', '4', 'Nicol', '&lt;p&gt;Вибір весільної сукні не терпить квапливості. У головний день життя кожної нареченої все повинно бути ідеально, а головне - вона сама повинна відчувати себе чарівною.&lt;/p&gt;\r\n\r\n&lt;p&gt;У своїй колекції салон весільних суконь &quot;Ксена&quot; представляє плаття моделі &quot;Nicol&quot;, яке подарує відчуття привабливості будь-якій дівчині. Це святкове вбрання втілення краси і ніжності стане прикрасою нареченої.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх сукні відкритий і акцентує увагу на зоні декольте, лінії шиї і плечей і підкреслює їх витонченість. Відкритий ліф сукні декорований ручною вишивкою і бісером, що безумовно приверне увагу до образу нареченої.&lt;/p&gt;\r\n\r\n&lt;p&gt;Корсет приталений і ідеально гармонує з пишною багатошаровою спідницею з фатину. Ззаду спідниця плавно переходить в шикарний шлейф, що надає образу легкості і грації. Низ і верх спідниці декорований широкими вставками мережива вручну обшитим бісером, що додає вбранню елегантності та вишуканості.&lt;/p&gt;\r\n\r\n&lt;p&gt;Салон весільних суконь &quot;Ксена&quot; надає Вам можливість купити плаття &quot;Nicol&quot; або вибрати інші ексклюзивні весільні сукні для Вашого особливого дня. Ми з радістю допоможемо Вам перетворити Ваше свято в казку!&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('54', '2', 'Nicol', '&lt;p&gt;Выбор подвенечного платья не терпит суеты. В главный день жизни каждой невесты всё должно быть идеально, а главное - она сама должна чувствовать себя очаровательной.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;В своей коллекции салон свадебных платьев &quot;Ксена&quot; представляет платье модели &quot;Nicol&quot;, которое подарит ощущение неотразимости и привлекательности любой девушке. Это праздничное облачение воплощение красоты и нежности станет украшением невесты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх платья открытый и акцентирует внимание на зоне декольте, линии шеи и плеч и подчеркивает их утонченность. Открытый лиф платья декорирован ручной вышивкой и бисером, что безусловно привлечет внимание к образу невесты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Корсет приталенный и идеально гармонирует с пышной многослойной юбкой из фатина. Сзади юбка плавно переходит в шикарный шлейф, что придает образу легкости и грации. Низ и верх юбки декорирован широкими вставками кружева вручную обшитым бисером, что добавляет наряду элегантности и изысканности.&lt;/p&gt;\r\n\r\n&lt;p&gt;Салон свадебных платьев &quot;Ксена&quot; предоставляет Вам возможность купить платье &quot;Nicol&quot; либо выбрать другие эксклюзивные свадебные платья для Вашего особенного дня. Мы с радостью поможем Вам превратить Ваш праздник в сказку!&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('53', '4', 'Caramel', '&lt;p&gt;Салон весільних суконь &quot;Ксена&quot; пропонує Вашій увазі ексклюзивні весільні сукні колекції 2016 року. У цій лінійці ви зможете знайти шикарні весільні сукні, в яких Ви не просто будете добре виглядати, в них Ви відчуєте себе королевою - красивою, вишуканою і бажаною.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня моделі &quot;Caramel&quot; ідеальний варіант для дівчат, які шукають класичну&amp;nbsp;вінчальну сукню з характером і родзинкою. Ця&amp;nbsp;весільна&amp;nbsp;сукня&amp;nbsp;на замовлення відповідає всім цим вимогам і навіть більше.&lt;/p&gt;\r\n\r\n&lt;p&gt;Перша особливість сукні - кольорове рішення. Дизайнери використовували поєднання білого і карамельного. Такий не дуже сильний контраст виглядає ніжно. Саме те, що потрібно щоб гості подумали: «ах, як незвично і красиво» і точно запам\'ятали Вас і Ваше весілля.&lt;/p&gt;\r\n\r\n&lt;p&gt;Додаткову увагу Вам і Вашому&amp;nbsp;вбранню&amp;nbsp;забезпечує наступний дизайнерський акцент - мереживо ручної роботи. Його використовують для обробки низу спідниці і корсета.&lt;/p&gt;\r\n\r\n&lt;p&gt;Пишна спідниця карамельного кольору внизу прикрашена широкою смугою мережива з незвичайним малюнком. А невеликий шлейф додає всьому образу королівської величі. Легкі тканини, використані для пошиття спідниці, спадають гарними складками, додаючи потрібного об\'єму, при цьому, не обтяжуючи всю сукню.&lt;/p&gt;\r\n\r\n&lt;p&gt;Корсет цієї моделі заслуговує на окрему увагу - закритий, приталений з елегантним вирізом-човником, він підкреслює всю красу і жіночність нареченої. Весь корсет і довгі рукави прикрашені білим мереживом.&lt;/p&gt;\r\n\r\n&lt;p&gt;Завершує все&amp;nbsp;це&amp;nbsp;незвичайне&amp;nbsp;вбрання&amp;nbsp;невеликий бантик, виконаний у двох кольорах. Така маленька грайлива нотка у&amp;nbsp;цій&amp;nbsp;елегантій, дорогій&amp;nbsp;і просто неперевершеній сукні.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('53', '2', 'Caramel', '&lt;p&gt;Салон свадебных платьев &quot;Ксена&quot; предлагает Вашему вниманию эксклюзивные свадебные платья коллекции 2016 года. В этой линейке вы сможете найти шикарные свадебные платья, в которых Вы не просто будете хорошо выглядеть, в них Вы почувствуете себя королевой – красивой, изысканной и желанной.&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье модели &quot;Caramel&quot; идеальный вариант &amp;nbsp;для девушек, которые ищут классическое подвенечное платье с характером и изюминкой. Это свадебное платье на заказ отвечает всем этим требованиям и даже больше.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Первая особенность платья – цветовое решение. Дизайнеры использовали сочетание белого и карамельного. Такой не слишком сильный контраст выглядит нежно, а не кричаще. Именно то, что нужно чтобы гости подумали: «ах, как необычно и красиво» и точно запомнили Вас и Вашу свадьбу.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Дополнительное внимание Вам и Вашему наряду обеспечивает следующий дизайнерский акцент – кружево ручной работы. Его используют для отделки низа юбки и корсета.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Пышная юбка карамельного цвета понизу украшена широкой полосой кружева с необычным рисунком. А небольшой шлейф добавляет всему образу королевского величия. Легкие ткани, использованные для пошива юбки, спадают красивыми складками, добавляя нужного объёма, при этом, не утяжеляя все платье.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Корсет этой модели заслуживает отдельного внимания – закрытый, приталенный с элегантным вырезом-лодочкой, он подчеркивает всю красоту и женственность невесты. Весь корсет и длинные рукава украшены белым кружевом.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Завершает весь этот необычный наряд небольшой бантик, выполненный в двух цветах. Такая маленькая игривая нотка в этом элегантном, дорогом и просто сногсшибательном платье.&amp;nbsp;&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('50', '1', 'Amazonka', '&lt;p&gt;The wedding salon «Ksena» offers classy bridal dresses which will turn fiancées into beautiful princesses on the most important feast of their life. The model of the dress «Amazonka»- isattire in a ballroom style in a white colour.&lt;/p&gt;\r\n\r\n&lt;p&gt;The open top enframes and visually creates the line of the shoulders and arms longer which makes the image open, confident and effective. The heart-shaped sensual bodice will profitably accent the volume and the line of the woman’s breasts.&lt;/p&gt;\r\n\r\n&lt;p&gt;The beaded handmade corset, which turns into an opulent skirt, nicely lays stress on the waist making it especially elegant. A volume airy skirt made of a few tissues of tulle looks expensive and has an amazing plush train that will make the image gorgeous and festive.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;On the most significant day of the life it is very important for the fiancée to be confident in her charming. «Amazonka»will emphasize the elegance of the figure, femininity and gracefulness.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('55', '3', 'Blanka', '&lt;p&gt;Die Hochzeit kundenspezifisches Kleid &quot;Blanca&quot; wird für Bräute durch Hochzeitssalon &quot;KSENA angeboten.&quot; Es ist gorgeous Beispiel von Eleganz und Stil.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ein weißes Kleid, mit traditionellen Ballsaal Silhouette, ausgestattetes Satin-Mieder und üppigen Rock aus Tüll ist ideal für Frauen mit jeder Art von Figur.&lt;/p&gt;\r\n\r\n&lt;p&gt;Harte Korsett hilft, die Taille enger zu machen und einen Akzent auf die Ordentlichkeit der Figur. Der Hauptfokus des Kleides wird zu seiner Oberseite gemacht. Das ganze Korsett ist mit dünnen Maschen bedeckt, bestickt mit Perlen und Steinen. Die Schultern sind mit breiten Riemen bedeckt; Ein bateau Halsausschnitt visuell macht Hals länger. Auf der Rückseite werden die breiten Riemen schmaler und bilden einen schönen Ausschnitt, der sich in die Schnürung verwandelt.&lt;/p&gt;\r\n\r\n&lt;p&gt;Rock besteht aus vielen dünnen Schichten aus Tüll und dem Euro-Gitter. Splendor der unteren macht einen zusätzlichen Akzent auf die Braut Figur. Ein kleiner Zug gibt eine Art von Lizenzgebühren für den gesamten Look.&lt;br /&gt;\r\nExklusive Brautkleider, die Youa Salon &quot;KSENA&quot; anbieten, wird Ihnen helfen, Ihren individuellen Look zu kreieren und sich wie eine Königin in Ihrem Urlaub zu fühlen.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('55', '1', 'Blanka', '&lt;p&gt;The wedding custom-designed dress&quot;Blanca&quot; is offered for brides by wedding salon &quot;KSENA.&quot; It’s gorgeous example of elegance and style.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;A white dress, with traditional ballroom silhouette, fitted satin bodice and lush skirt made of tulle is ideal for women with any type of figure.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Hard corset helps to make the waist more narrow and make an accent on the neatness of figure. The main focus of the dress is made to its top. The whole corset is covered with thin mesh, embroidered with beads and stones. The shoulders are covered with wide straps; a bateau neck cutout visually makes neck longer. On the back the broad straps are getting narrower, creating a beautiful neckline, which turns into the lacing.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Skirt consists of many thin layers of tulle and the euro-grid. Splendor of bottom makes an additional accent on the bride’s figure. A small train gives a manner of royalty to the whole look.&amp;nbsp;&lt;br /&gt;\r\nExclusive wedding dresses that offer Youa salon &quot;KSENA,&quot; will help You to create Your individual look and feel like a queen on Your holiday.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('55', '2', 'Blanka', '&lt;p&gt;Свадебное платье на заказ модели “Blanka” предлагает невестам салон свадебных платьев “Ксена”. Этот подвенечный наряд прекрасный образец элегантности и стиля.&lt;/p&gt;\r\n\r\n&lt;p&gt;Белое платье традиционного бального силуэта с приталенным атласным лифом и пышной фатиновой юбкой идеальный вариант для девушек с любым типом фигуры. &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Жесткий корсет модели “Blanka” помогает сделать талию уже и подчеркнуть изящность фигуры. Главный акцент в платье сделан именно на верх. Весь корсет обтянут тонкой сеткой, которая расшита бисером и камнями. Плечи прикрыты широкими бретельками, вырез лодочкой визуально удлиняет линию шеи. Сзади широкие лямки сужаются, создавая красивый вырез, переходящий в шнуровку.&lt;/p&gt;\r\n\r\n&lt;p&gt;Юбка платья состоит из большого числа тонких слоев фатина и евро-сетки. Пышность низа дополнительно акцентирует внимание на хрупкости фигуры невесты. Небольшой шлейф добавляет королевского величия всему образу.&lt;/p&gt;\r\n\r\n&lt;p&gt;Эксклюзивные свадебные платья, которые предлагает Вашему вниманию салон свадебных платьев “Ксена”, &amp;nbsp;помогут Вам создать свой индивидуальный образ и почувствовать себя королевой на Вашем празднике.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('57', '1', 'Nimfa', '&lt;p&gt;The wedding salon «Ksena» has prepared an exclusive offer for brides – a tailored wedding dress &quot;Nimfa&quot;.&lt;/p&gt;\r\n\r\n&lt;p&gt;This wedding dress amazes all brides with its magnificence and refinement. An exquisite A-line emphasizes bride’s fragility and elegance. Snow-white dress reminds the innocence and tenderness of a girl who is dressed in it. A thin satin belt visually makes the waist narrower and subtler.&lt;/p&gt;\r\n\r\n&lt;p&gt;A close-fitting in the waist satin corset smoothly turns into the middle-lush tulle skirt, which is decorated with a long, wide train. The top of the dress is covered with a lace cloth, embroidered with pearls, beads and sequins. The medium-length sleeve and a smallbateau neck cutout focus attention on a thin wrists, shoulders and neck.&lt;/p&gt;\r\n\r\n&lt;p&gt;Zest of the decoration is volume flowers which include handmade embroidery with beads and pearls. Delicate blossoms cover the whole corset, the top and the bottom of the skirt. Additionally along the lower portion there are inserts with the same using of bouquets.&lt;/p&gt;\r\n\r\n&lt;p&gt;Exclusive wedding dresses &quot;Nimfa&quot; emphasize brides’soleness and beauty, making them feel like queens on their special day.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('56', '1', 'Camelia', '&lt;p&gt;Luxurious wedding dresses from salon &quot;KSENA&quot; make a rich range, from which you can choose the wedding dress for every taste and budget.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Model &quot;Camelia&quot; shows modesty, innocence and tenderness embodied in the form, fabrics and decor. The classic of the wedding fashion is ballroom silhouette, which adorns any figure, making it feminine and delicate.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The snow-white purity of corset is emphasized with trim of delicate lace, cased with beads and pearls. Beautiful figured cutout attracts the gazes to the bare graceful neck and thin shoulders. Lace sleeves only reinforce the impression and focus the attention on slightly dropped waist line.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The wedding custom-designed dress&quot;Camelia&quot; differs with a very lush skirt with a train of medium length. A huge number of layers of tulle and matte hard euro-grid provide a chic volume.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The wedding salon&quot;KSENA&quot; offers brides a huge number of gorgeous wedding dresses that will make their look irresistible and impressive.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('56', '2', 'Camelia', '&lt;p&gt;Шикарные свадебные платья от салона &quot;Ксена&quot; составляют богатый модельный ряд, из которого можно выбрать подвенечный наряд на любой вкус и кошелек.&lt;/p&gt;\r\n\r\n&lt;p&gt;Модель &quot;Camelia&quot; это скромность, невинность и нежность, воплощенные в форме, ткани и декоре. Классика свадебной моды – бальный силуэт, украшает любую фигуру, делая её женственной и хрупкой.&lt;/p&gt;\r\n\r\n&lt;p&gt;Белоснежная чистота корсета подчеркнута отделкой из нежного кружева, обшитого бисером и жемчугом. Красивый фигурный вырез, привлекает взгляды к оголенной изящной шее и тонким плечам. Кружевные рукава только усиливают впечатление и акцентируют внимание на приспущенной линии корсета.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свадебное платье на заказ модели &quot;Camelia&quot; отличается очень пышной юбкой с шлейфом средней длины. Огромное количество слоев фатина и матовой жесткой евро-сетки обеспечивают шикарный объем.&lt;/p&gt;\r\n\r\n&lt;p&gt;Салон свадебных платьев “Ксена” предлагает невестам на выбор шикарные свадебные платья, которые сделают их образ неотразимым и впечатляющим.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('56', '4', 'Camelia', '&lt;p&gt;Шикарні весільні сукні від салону &quot;Ксена&quot; складають багатий модельний ряд, з якого можна вибрати вінчальне вбрання на будь-який смак і гаманець.&lt;/p&gt;\r\n\r\n&lt;p&gt;Модель &quot;Camelia&quot; це скромність, невинність і ніжність, втілені в формі, тканини і декорі. Класика весільної моди - бальний силует, прикрашає будь-яку фігуру, роблячи її жіночною і крихкою.&lt;/p&gt;\r\n\r\n&lt;p&gt;Білосніжна чистота корсета підкреслена обробкою з ніжного мережива, обшитого бісером і перлами. Гарний фігурний виріз, привертає погляди до оголеної витонченої шиї і тонким плечам. Мереживні рукава тільки підсилюють враження і акцентують увагу на приспущеній&amp;nbsp;лінії корсета.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весільна сукня на замовлення моделі &quot;Camelia&quot; відрізняється дуже пишною спідницею з шлейфом середньої довжини. Величезна кількість шарів фатину і матовою жорсткої євро-сітки забезпечують шикарний об\'єм.&lt;/p&gt;\r\n\r\n&lt;p&gt;Салон весільних суконь &quot;Ксена&quot; пропонує нареченим на вибір шикарні весільні сукні, які зроблять їх образ чарівним і вражаючим.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('55', '4', 'Blanka', '&lt;p&gt;Весільна сукня на замовлення моделі &quot;Blanka&quot; пропонує нареченим салон весільних суконь &quot;Ксена&quot;. Цей вінчальне&amp;nbsp;вбрання прекрасний зразок елегантності і стилю.&lt;/p&gt;\r\n\r\n&lt;p&gt;Біла &lt;span style=&quot;font-size: 13px;&quot;&gt;сукня&amp;nbsp;&lt;/span&gt;традиційного бального силуету з приталеним атласним ліфом і пишною фатіновой спідницею ідеальний варіант для дівчат з будь-яким типом фігури.&lt;/p&gt;\r\n\r\n&lt;p&gt;Жорсткий корсет моделі &quot;Blanka&quot; допомагає зробити талію вужчою&amp;nbsp;і підкреслити витонченість фігури. Головний акцент в &lt;span style=&quot;font-size: 13px;&quot;&gt;сукні&amp;nbsp;&lt;/span&gt;зроблений саме на верх. Весь корсет обтягнутий тонкою сіткою, яка розшита бісером і камінням. Плечі прикриті широкими бретельками, виріз човником візуально подовжує лінію шиї. Ззаду широкі лямки звужуються, створюючи красивий виріз, що переходить в шнурівку.&lt;/p&gt;\r\n\r\n&lt;p&gt;Спідниця сукні складається з великого числа тонких шарів фатину і євро-сітки. Пишність низу додатково акцентує увагу на крихкості фігури нареченої. Невеликий шлейф додає королівської величі всьому образу.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ексклюзивні весільні сукні, які пропонує Вашій увазі салон весільних суконь &quot;Ксена&quot;, допоможуть Вам створити свій індивідуальний образ і відчути себе королевою на Вашому святі.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('57', '4', 'Nimfa', '&lt;p&gt;Салон весільних суконь &quot;Ксена&quot; підготував для наречених ексклюзивну&amp;nbsp;пропозицію&amp;nbsp;- весільну сукню на замовлення &quot;Nimfa&quot;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Цей вінчальний наряд вражає пишністю і вишуканістю. Витончений А-силует підкреслює крихкість і витонченість нареченої. Білосніжність сукні нагадує про невинність і ніжність&amp;nbsp;дівчини, одягненої в нього. Тонкий поясок з атласу візуально робить талію вужчою і витонченішою.&lt;/p&gt;\r\n\r\n&lt;p&gt;Приталений атласний корсет плавно переходить в фатінову&amp;nbsp;спідницю середньої пишності, прикрашену ззаду довгим широким шлейфом. Верх сукні покритий мереживною тканиною, вручну обшитий&amp;nbsp;перлинами, бісером і паєтками. Рукав середньої довжини і невеликий виріз човником акцентують увагу на тонких зап\'ястях, плечах і шиї.&lt;/p&gt;\r\n\r\n&lt;p&gt;Родзинкою декору виступають об\'ємні накладні квіти з вишивкою ручної роботи, з використанням бісеру та перлів. Ніжні суцвіття покривають весь корсет, верх і низ спідниці. Додатково по нижній частині зроблені вставки з використанням таких же букетів.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ексклюзивні весільні сукні моделі &quot;Nimfa&quot; підкреслюють винятковість і красу наречених, дозволяючи відчути себе королевами в їх особливий день.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('57', '2', 'Nimfa', '&lt;p&gt;Салон свадебных платьев &quot;Ксена&quot; подготовил для невест эксклюзивное предложение – свадебное платье на заказ &quot;Nimfa&quot;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Этот подвенечный наряд поражает великолепием и изысканностью. Утонченный А-силуэт подчеркивает хрупкость и изящность невесты. Белоснежность платья напоминает о невинности и нежности девушки, облаченной в него. Тонкий поясок из атласа зрительно делает талию уже и утонченнее.&lt;/p&gt;\r\n\r\n&lt;p&gt;Приталенный атласный корсет плавно переходит в фатиновую юбку средней пышности, украшенную сзади длинным широким шлейфом. Верх платья покрыт кружевной тканью, вручную обшитой жемчужинами, бисером и паетками. Рукав средней длины и небольшой вырез лодочкой акцентируют внимание на тонких запястьях, плечах и шее.&lt;/p&gt;\r\n\r\n&lt;p&gt;Изюминкой декора выступают объемные накладные цветы с вышивкой ручной работы, с использованием бисера и жемчуга. Нежные соцветия покрывают весь корсет, верх и низ юбки. Дополнительно по нижней части сделаны вставки с использованием таких же букетов.&lt;/p&gt;\r\n\r\n&lt;p&gt;Эксклюзивные свадебные платья модели &quot;Nimfa&quot; подчеркивают исключительность и красоту невест, позволяя почувствовать себя королевами в их особенный день.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('53', '1', 'Caramel', '&lt;p&gt;A wedding salon &quot;Ksena&quot; offers an exclusive 2016’s collection of wedding dresses. In this range you will find posh wedding dresses in which you will not only look good, they will make you feel like a queen - beautiful, elegant and desirable.&lt;/p&gt;\r\n\r\n&lt;p&gt;&quot;Caramel&quot; dress is ideal variant for girls who are looking for classic wedding attire. This tailored wedding dress fits all these requirements and even more.&lt;/p&gt;\r\n\r\n&lt;p&gt;The first feature of the dress – is the color score. Designers have used a combination of white and caramel colours. Such not too strong contrast looks gentle, not flashy. It is quite the thing to make guests think: &quot;Oh, how unusual and beautiful it is&quot; and precisely remember You and your wedding.&lt;/p&gt;\r\n\r\n&lt;p&gt;Additional attention to You and Your attire provides the following designer accent –a handmade lace. It is used to trim the bottom of the skirt and corset.&lt;/p&gt;\r\n\r\n&lt;p&gt;A lush caramel skirt closer to the ground is decorated with a broad stripe of lace with an unusual pattern. A small train adds to a whole image a royal greatness. Lightweight cloths, which are used for sewing the skirt, subside with beautiful folds, adding a desired volume, not weighing the whole dress.&lt;/p&gt;\r\n\r\n&lt;p&gt;Corset of this model deserves a special attention - closed, close-fitting in the waist with an elegant bateau neck cutout. It emphasizes the bride’s beauty and femininity. The whole corset and long sleeves are decorated with a white lace.&lt;/p&gt;\r\n\r\n&lt;p&gt;A small bow, which is made in two colours, completes this unusual attire. Such a little playful overtone in this elegant, expensive and stunning dress.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('54', '1', 'Nicol', '&lt;p&gt;You do not have to choose your wedding dress in a hurry. On the main day of every bride’s life everything should be perfect, and the most important - she should feel charming.&lt;/p&gt;\r\n\r\n&lt;p&gt;There is a dress &quot;Nicol&quot; in the collection of the wedding dresses in salon &quot;Ksena&quot;, which will give a sense of irresistibility and attractiveness to any girl. This festive dress, which is the embodiment of beauty and tenderness, will decorate the bride.&lt;/p&gt;\r\n\r\n&lt;p&gt;The top of the dress is open and focuses attention on the bride’s decollete zone, neck and shoulder line; it emphasizes their refinement. The open bodice is decorated with handmade embroidery and beading that will attract attention to the bride’s image.&lt;/p&gt;\r\n\r\n&lt;p&gt;The corset is close-fitting in the waist and is in perfect harmony with the lush multi-layered skirt made of tulle. Behind &amp;nbsp;the skirt smoothly turns into a chic trail that gives the image lightness and grace. The bottom and the top of the skirt are decorated with wide handmade lace which is trimmed with beads, that gives the attire elegance and daintiness.&lt;/p&gt;\r\n\r\n&lt;p&gt;The wedding salon «Ksena»gives You an opportunity to buy a &quot;Nicol&quot; dress or to select another exclusive wedding dresses for your special day. We will be happy to help you to turn your holiday into a fairy tale!&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('50', '2', 'Amazonka', '&lt;p&gt;Салон свадебных платьев &quot;Ксена&quot; предлагает &amp;nbsp;шикарные свадебные платья, которые превратят невест в прекрасных принцесс на главном празднике их жизни. Модель платья &quot;Amazonka&quot; – это наряд бального фасона в белом цвете.&lt;/p&gt;\r\n\r\n&lt;p&gt;Открытый верх обрамляет и визуально удлиняет линию плеч и рук, делая образ открытым, уверенным и эффектным. Чувственный &amp;nbsp;лиф в форме «сердца» выгодно подчеркнёт объём и линию груди.&lt;/p&gt;\r\n\r\n&lt;p&gt;Вышитый бисером корсет ручной работы переходящий в пышную юбку деликатно подчеркивает талию, делая ее особенно изящной. Объёмная воздушная юбка из нескольких слоёв фатина смотрится дорого и имеет потрясающе шикарный шлейф, который в свою очередь придаст образу великолепия и торжественности.&lt;/p&gt;\r\n\r\n&lt;p&gt;В самый важный день жизни для невесты важно быть уверенной в своей очаровательности, &quot;Amazonka&quot; позволит подчеркнуть изящество фигуры, женственность и грациозность.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('50', '4', 'Amazonka', '&lt;p&gt;Салон весільних суконь &quot;Ксена&quot; пропонує шикарні весільні сукні, які перетворять наречених в прекрасних принцес на головному святі їхнього життя. Модель сукні &quot;Amazonka&quot; - це наряд бального фасону в білому кольорі.&lt;/p&gt;\r\n\r\n&lt;p&gt;Відкритий верх обрамляє і візуально подовжує лінію плечей і рук, роблячи образ вiдкритий, упевнений і ефектним. Чуттєвий ліф в формі «серця» вигідно підкреслить обсяг і лінію грудей.&lt;/p&gt;\r\n\r\n&lt;p&gt;Вишитий бісером корсет ручної роботи переходить в пишну спідницю делікатно підкреслює талію, роблячи її особливо витонченої. Об\'ємна повітряна спідниця з декількох шарів фатину виглядає дорого і має приголомшливо шикарний шлейф, який в свою чергу додасть образу пишноти й урочистості.&lt;/p&gt;\r\n\r\n&lt;p&gt;У найважливіший день життя для нареченої важливо бути впевненою в своїй чарівності, &quot;Amazonka&quot; дозволить підкреслити витонченість фігури, жіночність і граціозність.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('51', '2', 'Perla', '&lt;p&gt;Эксклюзивные свадебные платья представляет в коллекции 2015 года салон свадебных платьев «Ксена».&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье «Perla»- жемчужина этого модельного ряда.&lt;/p&gt;\r\n\r\n&lt;p&gt;Белоснежное платье с пышной юбкой, открытой спиной и небольшим шлейфом мгновенно притягивает к себе взгляд. Это свадебное платье на заказ заинтересует девушку, которая мечтает почувствовать себя принцессой на первом балу.&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье имеет классический крой с приталенным жестким корсетом и пышной многослойной юбкой. Лиф в форме сердца хорошо подчеркивает грудь. Вверху корсета ткань переходит в прозрачную сетку, края которой отделаны жемчужинами.&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье «Perla» на бретельках, без рукавов с вырезом лодочкой. Весь корсет покрыт замысловатыми узорами из жемчуга с вкраплениями камней.&lt;/p&gt;\r\n\r\n&lt;p&gt;Изюминка этого подвенечного наряда - спинка: сзади корсет имеет глубокий V-образный вырез закрытый сеткой и небольшой шлейф. Платье сзади застегивается на пуговицы, формирующие сплошную линию, что создает дополнительный акцент, притягивая взоры к спине.&lt;/p&gt;\r\n\r\n&lt;p&gt;Большое количество полупрозрачных слоев фатина без дополнительного декора придает платью необходимую пышность и невесомость.&lt;/p&gt;\r\n\r\n&lt;p&gt;Такое платье подойдет обладательницам изящной спинки и девушкам с долей авантюризма в характере. Элегантная и достаточно скромная классика кроя с одной стороны и соблазнительная загадка с другой – вот выбор смелых и стильных невест.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('51', '4', 'Perla', '&lt;p&gt;Ексклюзивні весільні сукні представляє в колекції 2015 року салон весільних суконь «Ксена».&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня «Perla» - перлина цього модельного ряду.&lt;/p&gt;\r\n\r\n&lt;p&gt;Білосніжна сукня з пишною спідницею, відкритою спиною і невеликим шлейфом миттєво притягує до себе погляд. Ця&amp;nbsp;весільна&amp;nbsp;сукня&amp;nbsp;на замовлення зацікавить дівчину, яка мріє відчути себе принцесою на першому балу.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня має класичний крій з приталеним жорстким корсетом і пишною багатошаровою спідницею. Ліф в формі серця добре підкреслює груди. Вгорі корсета тканина&amp;nbsp;переходить в прозору сітку, краї якої оброблені перлинами.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня «Perla» на бретельках, без рукавів з вирізом човником. Весь корсет покритий хитромудрими візерунками з перлів з вкрапленнями каменів.&lt;/p&gt;\r\n\r\n&lt;p&gt;Родзинка цього вінчального вбрання - спинка: ззаду корсет має глибокий V-подібний виріз закритий сіткою і невеликий шлейф. Сукня ззаду застібається на гудзики, що формують суцільну лінію, що створює додатковий акцент, притягаючи погляди до спини.&lt;/p&gt;\r\n\r\n&lt;p&gt;Велика кількість напівпрозорих шарів фатину без додаткового декору додає сукні необхідну пишність і невагомість.&lt;/p&gt;\r\n\r\n&lt;p&gt;Таке плаття підійде власницям витонченої спинки і дівчатам з часткою авантюризму в характері. Елегантна і досить скромна класика крою з одного боку і спокуслива загадка з іншого - ось вибір сміливих і стильних наречених.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('52', '4', 'Mishel', '&lt;p&gt;У весільному салоні &quot;Ксена&quot; Ви можете купити весільне плаття моделі &quot;Mishel&quot;. Представлене вбрання володіє просто дивовижним зовнішнім виглядом і елегантно впишеться в будь-яке весілля, зробивши Вас нареченою, яку запам\'ятають назавжди.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня &quot;Mishel&quot; А-силуету, виконане в молочному кольорі. Головна особливість крою такого весільного вбрання полягає в тому, що вузький верх &amp;nbsp;не здавлює, але візуально витягує фігуру нареченої.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ліф в формі «сердечка» зробить яскравий акцент на зоні декольте, а відкритий верх без рукава підкреслить витончені руки і плечі нареченої. Розшитий камінням і декорований ручною вишивкою корсет граціозно переходить в фатінову спідницю середньої пишності.&lt;/p&gt;\r\n\r\n&lt;p&gt;Цікавим декором спідниці служить вишивка ручної роботи, яка додасть образу граціозності. Акуратна вишивка чудово поєднується з плавним кроєм, підкреслюючи витонченість фігури нареченої, додаючи їй жіночності і чуттєвості. У такій сукні йдуть до вівтаря принцеси з найкрасивіших голлівудських фільмів, так чому б не вибрати наряд А-силует для свого торжества?&lt;/p&gt;\r\n\r\n&lt;p&gt;Поєднання всіх елементів весільного вбрання створює справжню гармонію в образі нареченої, що особливо важливо на весільному торжестві. Салон весільних суконь &quot;Ксена&quot; надає Вам можливість купити весільне плаття цієї моделі або пошити його на замовлення.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('52', '2', 'Mishel', '&lt;p&gt;В свадебном салоне “Ксена” Вы можете купить свадебное платье модели &quot;Mishel&quot;. Представленный наряд обладает просто изумительным внешним видом и элегантно впишется в любую свадьбу, сделав Вас невестой, которую запомнят навсегда.&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье &quot;Mishel&quot; А-силуэта, выполнено в молочном цвете. Главная особенность кроя такого свадебного наряда заключается в том, что поразительно узкий верх не сдавливает, но визуально вытягивает фигуру невесты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Лиф в форме «сердечка» сделает яркий акцент на зоне декольте, а открытый верх без рукава подчеркнёт изящные руки и плечи невесты. Расшитый камнями и декорирован ручной вышивкой корсет грациозно переходит в фатиновую юбку средней пышности.&lt;/p&gt;\r\n\r\n&lt;p&gt;Интересным декором юбки служит вышивка ручной работы, которая придаст образу грациозности. Аккуратная вышивка превосходно сочетается с плавным кроем, подчеркивая изящество фигуры невесты, добавляя ей женственности и чувственности. В таком платье идут к алтарю принцессы из красивых голливудских фильмов, так почему бы не выбрать наряд А-силуэт для собственного торжества?&lt;/p&gt;\r\n\r\n&lt;p&gt;Сочетание всех элементов свадебного убранства создает настоящую гармонию в образе невесты, что особенно важно на свадебном торжестве. Салон свадебных платьев “Ксена” предоставляет Вам возможность купить свадебное платье этой модели либо пошить его на заказ.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('60', '2', 'Olivia', '&lt;p&gt;Каждая невеста мечтает выглядеть в день свадьбы неотразимой, загадочной и стильной королевой. Эксклюзивные свадебные платья от салона &quot;Ксена&quot; – идеальный выбор для девушек, которые ищут свой неповторимый образ.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свадебное платье на заказ модели &quot;Olivia&quot; именно тот вариант, который поможет любой невесте воплотить свои мечты о прекрасном подвенечном наряде.&lt;/p&gt;\r\n\r\n&lt;p&gt;Эта модель классического бального типа с пышной многослойной юбкой и приталенным корсетом как нельзя лучше подчеркнет все достоинства фигуры. А декоративная отделка сделает весь образ изысканным, добавив стиля и шика.&lt;/p&gt;\r\n\r\n&lt;p&gt;Атласный корсет с лифом в форме сердечка покрыт тонкой нежной сеткой. Особенность этого платья – отделка. Дизайнеры использовали тонкое кордовое кружево, вручную обшитое паетками, бисером и жемчугом. Крупными цветами, небольшими соцветиями, веточками и завитками обшит весь корсет, линия выреза, спинка и рукава платья.&lt;/p&gt;\r\n\r\n&lt;p&gt;Для юбки мастера использовали огромное количество слоев фатина. Украшением для нее служат небольшие вставки расшитого кружева &amp;nbsp;по верху и удлиненный шлейф.&lt;/p&gt;\r\n\r\n&lt;p&gt;Заказав подвенечный наряд модели &quot;Olivia&quot;, который предлагает свои клиентам салон свадебных платьев &quot;Ксена&quot; Вы будете уверены в том, что в такой важный для Вас день Вы будете выглядеть неповторимо, и сразите всех гостей своей красотой.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('60', '4', 'Olivia', '&lt;p&gt;Кожна наречена мріє виглядати в день весілля чарівною, загадковою і стильною королевою. Ексклюзивні весільні сукні від салону &quot;Ксена&quot; - ідеальний вибір для дівчат, які шукають свій неповторний образ.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весільна сукня на замовлення моделі &quot;Olivia&quot; саме той варіант, який допоможе будь-якій нареченій втілити свої мрії про прекрасне шлюбне&amp;nbsp;вбрання.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ця модель класичного бального типу з пишною багатошаровою спідницею і приталеним корсетом якнайкраще підкреслить всі достоїнства фігури. А декоративне оздоблення зробить весь образ вишуканим, додавши стилю і шику.&lt;/p&gt;\r\n\r\n&lt;p&gt;Атласний корсет з ліфом в формі сердечка покритий тонкою ніжною сіткою. Особливість цієї&amp;nbsp;сукні - обробка. Дизайнери використовували тонке кордове мереживо, вручну обшите паєтками, бісером і перлами. Великими квітами, невеликими суцвіттями, гілочками і завитками обшитий весь корсет, лінія вирізу, спинка і рукави сукні.&lt;/p&gt;\r\n\r\n&lt;p&gt;Для спідниці майстри використовували величезну кількість шарів фатину. Окрасою для неї служать невеликі вставки розшитого мережива по верху і подовжений шлейф.&lt;/p&gt;\r\n\r\n&lt;p&gt;Замовивши вінчальне вбрання моделі &quot;Olivia&quot;, яке пропонує своїм клієнтам салон весільних суконь &quot;Ксена&quot; Ви будете впевнені в тому, що в такий важливий для Вас день Ви будете виглядати неповторно, і уб\'єте всіх гостей своєю красою.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('60', '3', 'Olivia', '&lt;p&gt;Jede Braut will an ihrem Hochzeitstag unwiderstehliche, mysteriöse und stilvolle Königin aussehen. Exklusive Brautkleider aus dem Salon &quot;Ksena&quot; ist eine perfekte Wahl für Frauen, die ein einzigartiges Bild suchen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ein maßgeschneidertes Hochzeitskleid &quot;Olivia&quot; ist die sehr Option, die jede Braut helfen, ihre Träume von einem schönen Brautkleid zu verwirklichen&lt;/p&gt;\r\n\r\n&lt;p&gt;Dieses klassische Ball-Modell mit einem mehrschichtigen üppigen Rock und eng anliegend in der Taille Korsett wird Akzent auf alle Würde der Figur. Und dekorative Ordnung wird das ganze Bild verfeinert, indem Stil und Chic.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ein Satin-Korsett zusammen mit herzförmigen Mieder ist mit dünnen weichen Netz. Die Besonderheit dieses Kleides ist seine Besatzung. Designer haben eine dünne Schnur Spitze, hand-trimmed mit Pailletten, Perlen und Perlen verwendet. Das gesamte Korsett, Ausschnitt, Rücken und Ärmel sind mit großen Blüten, kleinen Blütenständen, Zweigen und Locken beschnitten.&lt;/p&gt;\r\n\r\n&lt;p&gt;Masters haben eine riesige Anzahl von Tüll-Schichten für den Rock verwendet. Seine Verzierungen sind kleine gestickte Spitzeneinsätze auf die Oberseite und ein verlängerter Zug.&lt;/p&gt;\r\n\r\n&lt;p&gt;Nachdem Sie das Hochzeitskleid &quot;Olivia&quot; bestellt haben, das den Kunden im Salon der Brautkleider &quot;Ksena&quot; angeboten wird, werden Sie sicher sein, dass Sie an einem so wichtigen Tag für Sie aussehen und alle Gäste staunen werden Durch Ihre Schönheit.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('60', '1', 'Olivia', '&lt;p&gt;Every bride wants to look irresistible, mysterious and stylish queen on her wedding day. Exclusive wedding dresses from salon &quot;Ksena&quot; is a perfect choice for women who are looking for a unique image.&lt;/p&gt;\r\n\r\n&lt;p&gt;A tailored wedding dress &quot;Olivia&quot; is the very option that will help any bride to realize her dreams of a beautiful wedding dress&lt;/p&gt;\r\n\r\n&lt;p&gt;This classic ball-type model with a multi-layered lush skirt and close-fitting in the waist corset will make accent on all the dignities of the figure. And decorative trim will make the whole image refined, adding style and chic.&lt;/p&gt;\r\n\r\n&lt;p&gt;A satin corset along with heart-shaped bodice is covered with thin soft netting. The peculiarity of this dress is its trimming. Designers have used a thin cord lace, hand-trimmed with sequins, beads and pearls. The whole corset, cutout’s line, back and sleeves are trimmed with large flowers, small inflorescences, twigs and curls.&lt;/p&gt;\r\n\r\n&lt;p&gt;Masters have used a huge number of tulle’s layers for the skirt. Its decorations are small embroidered lace’s inserts on the top and a lengthened train.&lt;/p&gt;\r\n\r\n&lt;p&gt;Having ordered the wedding dress &quot;Olivia&quot;, which is offered &amp;nbsp;to customers by salon of the wedding dresses &quot;Ksena&quot;, You will be assured that on such an important day for You, You will look one and only and all the guests will be amazed by Your beauty.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('61', '2', 'Сarmen', '&lt;p&gt;Выбор подвенечного наряда важный момент, в котором лучше обращаться к профессионалам. Салон свадебных платьев &quot;Ксена&quot; то место где Вы сможете подобрать для себя идеальное свадебное платье на заказ. Широкая линейка моделей угодит любому вкусу и требованиям.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свадебное платье на заказ модели &quot;Carmen&quot; гармонично сочетает в себе классику бального силуэта и современные тенденции декора.&lt;/p&gt;\r\n\r\n&lt;p&gt;При разработке модели дизайнеры сделали главный акцент на отделке верха. Атласный приталенный корсет покрыт нежным, тонким кружевом, которое додает всему образу аристократичности. Мастера вручную расшили всю поверхность бисером, паетками и жемчужинами сотворив причудливые красивые узоры. Дополнительное внимание притягивают приспущенный на плечи фигурный вырез и короткие рукавчики, позволяя жениху вдоволь любоваться на изящную шею избранницы.&lt;/p&gt;\r\n\r\n&lt;p&gt;Юбка платья грамотно дополняет весь образ. Пышная, благодаря большому количеству слоев фатина она не создает впечатления громоздкости, наоборот выглядит как воздушное облако. Усиливает эффект невесомости небольшой легкий шлейф.Завершающим штрихом выступает тонкий пояс расшитый камнями, подчеркивающий хрупкость и нежность невесты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Эксклюзивные свадебные платья от салона &quot;Ксена&quot; помогут воплотить в жизнь Ваш идеальный образ. Наши платья акцентируют внимание на Вашей исключительности, грации и красоте.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('61', '4', 'Сarmen', '&lt;p&gt;Вибір вінчального вбрання важливий момент, в якому краще звертатися до професіоналів. Салон весільних суконь &quot;Ксена&quot; це місце де Ви зможете підібрати для себе ідеальне весільну сукню на замовлення. Широка лінійка моделей догодить будь-якому смаку і вимогам.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весільна сукня на замовлення моделі &quot;Carmen&quot; гармонійно поєднує в собі класику бального силуету і сучасні тенденції декору.&lt;/p&gt;\r\n\r\n&lt;p&gt;При розробці моделі дизайнери зробили головний акцент на обробці верху. Атласний приталений корсет покритий ніжним, тонким мереживом, яке додає всьому образу аристократичності. Майстри вручну розшили всю поверхню бісером, паєтками та перлинами створивши красиві візерунки. Додаткову увагу притягують приспущений на плечі фігурний виріз і короткі рукавчики, дозволяючи нареченому вдосталь милуватися на витончену шию обраниці.&lt;/p&gt;\r\n\r\n&lt;p&gt;Спідниця сукні грамотно доповнює весь образ. Пишна, завдяки великій кількості шарів фатину вона не створює враження громіздкості, навпаки виглядає як повітряна&amp;nbsp;хмаринка. Підсилює ефект невагомості невеликий легкий шлейф. Завершальним&amp;nbsp;штрихом виступає тонкий пояс розшитий камінням, що підкреслює крихкість і ніжність нареченої.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ексклюзивні весільні сукні від салону &quot;Ксена&quot; допоможуть втілити в життя Ваш ідеальний образ. Наші сукні акцентують увагу на Вашій винятковості, грації та красі.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('61', '3', 'Сarmen', '&lt;p&gt;Eine Auswahl an einem Hochzeitskleid ist ein wichtiger Moment, der besser ist, mit den Profis vorbereitet werden.Der Hochzeitssalon &quot;Ksena&quot; ist der Ort, wo Sie ein perfektes Kleid nach Maß zu wählen. Eine breite Strecke der Modelle gefallenany Geschmack und Anforderungen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eine Hochzeit maßgeschneiderte Kleid &quot;Carmen&quot; kombiniert die klassische Ballsaal Silhouette und moderne Dekor-Trends.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Designer haben den Schwerpunkt auf die Beschneidung der Spitze. Ein Satin eng anliegend in der Taille Korsett ist mit einer weichen, zarten Spitze, die das Bild ein Blick von Aristokratie. Masters haben die ganze Oberfläche mit Perlen, Pailletten und Perlen bestickt, schöne Muster erstellt. Eine zusätzliche Aufmerksamkeit wird durch halbmastigen figürlichen Ausschnitt auf den Schultern und kurzen Handschuhen, die Bräutigam, um die Braut den sauberen Hals zu bewundern locken angezogen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Rock richtig ergänzt das ganze Bild. Lush aufgrund der großen Menge von Tüll-Schichten der Rock sieht nicht umständlich, aber im Gegenteil-es sieht aus wie eine leichte Wolke. Ein kleiner leichter Zug erhöht die Wirkung der Schwerelosigkeit. Dünne Gürtel mit Steinen bestickt, die die Zerbrechlichkeit und Zärtlichkeit der Braut unterstreicht, ist ein Finishing-Merkmal.&lt;/p&gt;\r\n\r\n&lt;p&gt;Exklusive Brautkleider aus dem Salon &quot;Ksena&quot; wird Ihnen helfen, Ihr Idealbild zu verwirklichen. Unsere Kleider legen Stress auf Ihre Exklusivität, Anmut und Schönheit.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('61', '1', 'Сarmen', '&lt;p&gt;A choice of a wedding dress is an important moment which is better to be prepared with the professionals.The wedding salon &quot;Ksena&quot; is the very place where you can choose a perfect made-to-order dress. A wide range of models will pleaseany taste and requirements.&lt;/p&gt;\r\n\r\n&lt;p&gt;A wedding tailored dress &quot;Carmen&quot; combines the classic ballroom silhouette and modern decor trends.&lt;/p&gt;\r\n\r\n&lt;p&gt;The designers have made the main focus on the top’s trimming. A satin close-fitting in the waist corset is covered with soft, delicate lace that gives the image a look of aristocracy. Masters have embroidered the entire surface with beads, sequins and pearls, having created beautiful patterns. An additional attention is attracted by half-masted figured cutout on the shoulders and short gloves that allows groom to admire his bride’s neat neck.&lt;/p&gt;\r\n\r\n&lt;p&gt;Skirt properly complements the whole image. Lush due to the big amount of tulle’s layers the skirt does not look cumbersome, but on the contrary- it looks like a lightweight cloud. A small light train increases the effect of weightlessness. Thin belt embroidered with stones, which underlines bride’s fragility and tenderness, is a finishing trait.&lt;/p&gt;\r\n\r\n&lt;p&gt;Exclusive wedding dresses from salon &quot;Ksena&quot; will help You to realize Your ideal image. Our dresses lay stress on Your exclusivity, grace and beauty.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('62', '2', 'Diva', '&lt;p&gt;Шикарные свадебные платья разработал для своих клиентов салон свадебных платьев &quot;Ксена&quot;. Свадебное платье на заказ модели &quot;Diva&quot; поможет любой невесте почувствовать себя величественной королевой, сражающей всех своим великолепным видом.&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье &quot;Diva&quot; классического бального кроя, с корсетом подчеркивающим талию и бюст и объемной юбкой с небольшим шлейфом является прекрасным образцом традиционной свадебной моды.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх платья украшен тонкой сеткой расшитой вручную камнями, паетками и бисером. Замысловатые узоры складываются в красивую картинку притягивающую взгляд. Небольшой вырез лодочкой акцентирует внимание на изящной шее и красивых плечах невесты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Платье без рукавов, что позволяет обратить все внимание на тонкие нежные ручки и пальчики, на одном из которых будет красоваться обручальное кольцо.&lt;/p&gt;\r\n\r\n&lt;p&gt;Спинка платья имеет интересную форму, наверху две широкие лямки закреплены на пуговичку, а снизу остается открытая часть демонстрирующая красивую спинку невесты.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свадебное платье на заказ от ТМ &quot;Ксена&quot; это Ваш залог хорошего настроения и прекрасного внешнего вида в такой важный для Вас день.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('62', '4', 'Diva', '&lt;p&gt;Шикарні весільні сукні розробив для своїх клієнтів салон весільних суконь &quot;Ксена&quot;. Весільна сукня на замовлення моделі &quot;Diva&quot; допоможе будь-якій нареченій відчути себе величною королевою, що вбиває всіх своїм чудовим виглядом.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня &quot;Diva&quot; класичного бального крою, з корсетом підкреслює талію і бюст і об\'ємною спідницею з невеликим шлейфом є ​​прекрасним зразком традиційної весільної моди.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх сукні прикрашений тонкою&amp;nbsp;сіткою розшитою&amp;nbsp;вручну камінням, паєтками та бісером. Хитромудрі візерунки, що складаються в красиву картинку притягують&amp;nbsp;погляд. Невеликий виріз човником акцентує увагу на витонченій шиї і красивих плечах нареченої.&lt;/p&gt;\r\n\r\n&lt;p&gt;Сукня без рукавів, що дозволяє звернути всю увагу на тонкі ніжні ручки і пальчики, на одному з яких буде красуватися обручка.&lt;/p&gt;\r\n\r\n&lt;p&gt;Спинка сукні має цікаву форму, нагорі дві широкі лямки закріплені на гудзик, а знизу залишається відкрита частина демонструє гарну спинку нареченої.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весільна сукня на замовлення від ТМ &quot;Ксена&quot; це запорука&lt;span style=&quot;font-size: 13px;&quot;&gt;&amp;nbsp;Вашого&lt;/span&gt;&amp;nbsp;гарного настрою і прекрасного зовнішнього вигляду в такий важливий для Вас день.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('62', '1', 'Diva', '&lt;p&gt;The wedding salon «Ksena» has created luxurious wedding dresses for its customers. Made-to-order wedding gown «Diva» will help any bride to feel herself like a majestic queen, who amazes everyone by her magnificent look.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Dress «Diva», which is made of a classic ballroom cutout, with a corset that lays stress on the waist and woman’s breast and with a full skirt including a small train is a perfect example of traditional wedding fashion.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The top of the dress is decorated with thin netting which is embroidered by hand with stones, sequins and beads. Intricate patterns create a pretty picture that catches attention. A small boat neckline emphasizes the bride’s elegant neck and shoulders.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;This is a sleeveless dress that allows setting eyes on the subtle delicate hands and fingers, one of which will have an engagement ring.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The back of the dress has an interesting shape; on the top there are two wide straps that are fastened with a small button. On the underside there remains an open part, which shows bride’s beautiful back.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The tailored wedding dress from TM «Ksena» is your guarantee of good mood and gorgeous appearance on such an important day for you.&amp;nbsp;&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('62', '3', 'Diva', '&lt;p&gt;Der Hochzeitssalon «Ksena» hat luxuriöse Brautkleider für seine Kunden geschaffen. Nach Maß Hochzeitskleid «Diva» hilft jeder Braut, sich wie eine majestätische Königin zu fühlen, die jeder durch ihren ausgezeichneten Blick wundern.&lt;/p&gt;\r\n\r\n&lt;p&gt;Kleid &quot;Diva&quot;, das aus einem klassischen Ballsaalausschnitt besteht, mit einem Korsett, das Stress auf die Taille und die Brust der Frau legt und mit einem vollen Rock mit einem kleinen Zug ist ein perfektes Beispiel für traditionelle Brautmode.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Spitze des Kleides ist mit dünnen Netzen, die von Hand mit Steinen, Pailletten und Perlen bestickt ist. Verwickelte Muster schaffen ein hübsches Bild, das Aufmerksamkeit erregt. Ein kleiner Bootausschnitt unterstreicht den eleganten Hals und die Schultern der Braut.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dies ist ein ärmelloses Kleid, das Einstellung der Augen auf die subtile zarte Hände und Finger, von denen eine Verlobungsring haben wird ermöglicht.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Rückseite des Kleides hat eine interessante Form; Auf der Oberseite gibt es zwei breite Riemen, die mit einem kleinen Knopf befestigt werden. Auf der Unterseite bleibt ein offener Teil, der den schönen Rücken der Braut zeigt.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das maßgeschneiderte Brautkleid von TM «Ksena» ist Ihre Garantie für eine gute Stimmung und ein herrliches Aussehen an einem so wichtigen Tag für Sie.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('63', '2', 'Francheska', '&lt;p&gt;Невеста – главная героиня свадебного дня, и выглядеть она должна великолепно. Шикарные свадебные платья , которые представляет в линейке 2016 года салон свадебных платьев &quot;Ксена&quot;, помогут создать девушкам неповторимый, запоминающейся образ.&lt;/p&gt;\r\n\r\n&lt;p&gt;Модель &quot;Francheska&quot; идеально подойдет девушкам, которые хотят подчеркнуть свою нежность, невинность и скромность.&lt;/p&gt;\r\n\r\n&lt;p&gt;Белоснежность платья, минимум декоративных элементов, пышность юбки и красивые изгибы корсета – скромная никогда не выходящая из моды классика. Это платье тонко подчеркивает красоту самой невесты, не перенимая на себя взгляды всех присутствующих на свадьбе.&lt;/p&gt;\r\n\r\n&lt;p&gt;Юбка выглядит практически невесомой благодаря тонкому фатину, из которого она пошита. Украшением для нее служит красивый широкий шлейф, придающий всему образу определенного величия.&lt;/p&gt;\r\n\r\n&lt;p&gt;Корсет платья короткий и открывает вид на красивую линию плеч и декольте. Верх сделан в форме сердечка и прекрасно подчеркивает и поддерживает грудь. Корсет задекорирован драпировкой из ткани.&lt;/p&gt;\r\n\r\n&lt;p&gt;Изюминки этому элегантному, скромному образу придает небольшой цветной пояс из ленты. Также по желанию невесты его можно выполнить в любом цвете, задекорировать кружевом и обшить камнями, паетками, бисером или жемчугом.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свадебное платье на заказ &quot;Francheska&quot; воплощение стиля, элегантности и скромности для &amp;nbsp;тех, кто хочет почувствовать себя королевой.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('63', '4', 'Francheska', '&lt;p&gt;Наречена - головна героїня весільного дня, і виглядати вона повинна чудово. Шикарні весільні сукні, які представляє в лінійці 2016 року салон весільних суконь &quot;Ксена&quot;, допоможуть створити дівчатам неповторний, що запам\'ятовується образ.&lt;/p&gt;\r\n\r\n&lt;p&gt;Модель &quot;Francheska&quot; ідеально підійде дівчатам, які хочуть підкреслити свою ніжність, невинність і скромність.&lt;/p&gt;\r\n\r\n&lt;p&gt;Білосніжність сукні, мінімум декоративних елементів, пишність спідниці і красиві вигини корсета - скромна &lt;span style=&quot;font-size: 13px;&quot;&gt;класика, що&lt;/span&gt;&amp;nbsp;ніколи не виходить з моди. Ця&amp;nbsp;сукня тонко підкреслює красу самої нареченої, не переймаючи на себе погляди всіх присутніх на весіллі.&lt;/p&gt;\r\n\r\n&lt;p&gt;Спідниця виглядає практично невагомою завдяки тонкому фатину, з якого вона пошита. Окрасою для неї служить гарний широкий шлейф, що надає всьому образу певної&amp;nbsp;величі.&lt;/p&gt;\r\n\r\n&lt;p&gt;Корсет сукні короткий і відкриває вид на красиву лінію плечей і декольте. Верх зроблений у формі сердечка і прекрасно підкреслює і підтримує груди. Корсет задекорований драпіровкою з тканини.&lt;/p&gt;\r\n\r\n&lt;p&gt;Родзинку&amp;nbsp;цьому&amp;nbsp;елегантному, скромному образу надає невеликий кольоровий пояс зі стрічки. Також за бажанням нареченої його можна виконати в будь-якому кольорі, задекорувати мереживом і обшити камінням, паєтками, бісером або перлами.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весільна сукня на замовлення &quot;Francheska&quot; втілення стилю, елегантності і скромності для тих, хто хоче відчути себе королевою.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('63', '3', 'Francheska', '&lt;p&gt;Eine Braut ist die Hauptheldin des Hochzeitstages, und sie muss wunderschön aussehen. Schicke Brautkleider der Kollektion 2016, die den Hochzeitssalon &quot;Ksena&quot; anbieten, helfen Mädchen, ein einzigartiges und unvergessliches Bild zu schaffen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Modell &quot;Francheska&quot; ist ideal für Mädchen, die ihre Zärtlichkeit, Unschuld und Bescheidenheit betonen wollen.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dress Schneewittchen, minimale dekorative Elemente, Pomp des Rockes und schöne Kurven eines Korsetts ist ein bescheidener Klassiker, der nie aus der Mode gehen wird. Dieses Kleid zart betont die Braut Schönheit und nicht übernehmen die Blicke aller Gäste der Hochzeit.&lt;/p&gt;\r\n\r\n&lt;p&gt;Rock sieht fast schwerelos aufgrund der feinen Tüll, von denen es genäht wird. Eine erstaunliche breite Zug ist seine Dekoration, die gewisse Größe für den gesamten Look gibt.&lt;/p&gt;\r\n\r\n&lt;p&gt;Kurzes Korsett lindert die schöne Schultern und Dekolletee. Eine herzförmige Spitze unterstreicht die Brust perfekt. Korsett ist mit Stoffvorhang verziert.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eine Ehrlichkeit zu diesem eleganten und bescheidenen Kleid legt einen kleinen farbigen Taillenbund aus Band. Auch auf Wunsch der Braut kann dieser Gürtel in jeder Farbe hergestellt werden, mit Spitzen verziert und mit Steinen, Pailletten, Perlen oder Perlen vernäht.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das maßgeschneiderte Brautkleid &quot;Francheska&quot; ist eine Verkörperung von Stil, Eleganz und Bescheidenheit für diejenigen, die sich wie Königinnen fühlen wollen.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('63', '1', 'Francheska', '&lt;p&gt;A bride is the main heroine of the wedding day, and she has to look gorgeously. Chic wedding dresses of 2016’s collection that offer the wedding salon &quot;Ksena&quot; will help girls to create a unique and memorable image.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Model &quot;Francheska&quot; is ideal for girls who want to emphasize their tenderness, innocence and modesty.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Dress’s snow-whiteness, minimum of decorative elements, pomp of the skirt and beautiful curves of a corset is a modest classic, which will never go out of vogue. This dress delicately emphasizes the bride’s beauty and doesn`t take over the gazes of all guests of the wedding.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Skirt looks almost weightless due to the fine tulle of which it is sewed. An amazing wide train is its decoration that gives certain greatness to the entire look.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Short corset unmuffles the beautiful line of shoulders and décolleté. A heart-shaped top perfectly emphasizes and retains the breast. Corset is decorated with fabric’s drapery.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;A zest to this elegant and modest dress attaches a small coloured waistband made of ribbon. Also on the bride’s request this belt can be made in any colour, decorated with lace and sewed round with stones, sequins, beads or pearls.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;The tailored wedding dress &quot;Francheska&quot; is an embodiment of style, elegance and modesty for those who want to feel themselves like queens.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('64', '1', 'Nika', '&lt;p&gt;For supporters of the elegant simplicity and eternal classic the wedding salon «Ksena» offers such model of the wedding gowns as «Nika».&lt;/p&gt;\r\n\r\n&lt;p&gt;This tailored wedding dress will conquer You by its traditional ballroom form and tender unobtrusive decoration.&lt;/p&gt;\r\n\r\n&lt;p&gt;Close-fitting in the waist open corset with heart-shaped décolleté attracts attention to the fragile bride’s figure, elegant line of shoulders and neck. Corset’s decorative trimming is made of lace which is embroidered by hand with beads and pearls.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;A full skirt makes the whole image lightweight and imponderable which gives the impression that bride is robed into an airy cloud. A thin placer of pearls and beads on the top of the skirt and a small train are the finishing details in this charming ensemble.&lt;/p&gt;\r\n\r\n&lt;p&gt;Exclusive wedding dresses which offers salon «Ksena» - is a great possibility to make Your look the very same as You dreamed.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('64', '2', 'Nika', '&lt;p&gt;Для сторонников элегантной простоты и вечной классики салон свадебных платьев &quot;Ксена&quot; предлагает модель &quot;Nika&quot;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Это свадебное платье на заказ покорит Вас своей традиционной бальной формой и нежным ненавязчивым декором.&lt;/p&gt;\r\n\r\n&lt;p&gt;Приталенный открытый корсет с декольте в форме сердечка обращает взоры на хрупкую фигуру невесты, изящную линию плеч и шеи. Декоративная отделка корсета выполнена из кружева, вручную расшитого бисером и жемчугом.&lt;/p&gt;\r\n\r\n&lt;p&gt;Пышная юбка делает весь образ легким и невесомым, создавая впечатление, что невеста облачена в воздушное облако. Тонкая россыпь жемчуга и бисера по верху юбки и небольшой шлейф выступают завершающей ноткой в этом очаровательном ансамбле.&lt;/p&gt;\r\n\r\n&lt;p&gt;Эксклюзивные свадебные платья которые предлагает салон свадебных платьев &quot;Ксена&quot; - Ваша возможность сделать свой образ точно, таким как Вы мечтали.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('64', '4', 'Nika', '&lt;p&gt;Для прихильників елегантної простоти і вічної класики салон весільних суконь &quot;Ксена&quot; пропонує модель &quot;Nika&quot;.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ця&amp;nbsp;весільна&amp;nbsp;сукня на замовлення підкорить Вас своєю традиційною бальною формою і ніжним ненав\'язливим декором.&lt;/p&gt;\r\n\r\n&lt;p&gt;Приталений відкритий корсет з декольте у формі сердечка звертає погляди на тендітну фігуру нареченої, витончену лінію плечей і шиї. Декоративне оздоблення корсета виконана з мережива, вручну розшитого бісером і перлами.&lt;/p&gt;\r\n\r\n&lt;p&gt;Пишна спідниця робить весь образ легким і невагомим, створюючи враження, що наречена одягнена в повітряну&amp;nbsp;хмарку. Тонка розсип перлів і бісеру по верху спідниці і невеликий шлейф виступають завершальною&amp;nbsp;ноткою в цьому чарівному ансамблі.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ексклюзивні весільні сукні які пропонує салон весільних суконь &quot;Ксена&quot; - Ваша можливість зробити свій образ точно, таким як Ви мріяли.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('64', '3', 'Nika', '&lt;p&gt;Für Unterstützer der eleganten Einfachheit und des ewigen Klassikers bietet der Hochzeitssalon «Ksena» ein solches Modell der Brautkleider wie «Nika» an.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dieses maßgeschneiderte Hochzeitskleid wird Sie durch seine traditionelle Ballsaalform und zarte unaufdringliche Dekoration erobern.&lt;/p&gt;\r\n\r\n&lt;p&gt;Eng anliegend in der Taille offen Korsett mit herzförmigen Dekolleté zieht die Aufmerksamkeit auf die fragile Braut Figur, elegante Linie von Schultern und Hals. Korsetts dekorative Beschnitt ist aus Spitze, die von Hand mit Perlen und Perlen bestickt ist gemacht.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; Ein voller Rock macht das ganze Bild leicht und imponderable, die den Eindruck erweckt, dass Braut in eine luftige Wolke gekleidet ist. Ein schmaler Perlen- und Perlenring auf der Oberseite des Rockes und ein kleiner Zug sind die letzten Details in diesem charmanten Ensemble.&lt;/p&gt;\r\n\r\n&lt;p&gt;Exklusive Brautkleider, die Salon bietet «Ksena» - ist eine großartige Möglichkeit, um Ihren Blick der selben wie Sie geträumt.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('65', '2', 'Lolita', '&lt;p&gt;Каждая невеста мечтает в день свадьбы выглядеть неповторимо и волшебно. Эксклюзивные свадебные платья от салона &quot;Ксена&quot; - Ваш главный помощник в этом.&lt;/p&gt;\r\n\r\n&lt;p&gt;Свадебное платье на заказ модели &quot;Lolita&quot; – Ваша возможности почувствовать себя сказочной героиней, очаровательной нимфой, которая одним видом может вскружить голову.&lt;/p&gt;\r\n\r\n&lt;p&gt;Это свадебное платье на заказ сочетает в себе утонченность и экстравагантность благодаря своей оригинальной форме – «рыбка» или «русалка». Такой подвенечный наряд – выбор смелых невест, которые хотят запомниться всем гостям и получить несчетное количество восторженных взглядов и комплиментов.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх платья представляет собой удлиненный до колен, приталенный корсет, который прекрасно подчеркивает изящность и хрупкость фигуры. От колен начинается пышная широкая юбка.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весь корсет, низ и верх юбки украшены кордовым кружевом вручную расшитым бисером и паетками. Красивая форма лифа – сердечко выгодно подчеркивает грудь.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх и рукава выполнены из тонкой сетки и задекорированы кружевом с добавлением бисера и паеток. Практически полностью оголенная, прикрытая только тонкой дымкой сетки и затейливым рисунком кружева спинка добавляет платью особого шика, великолепия и королевского величия.&lt;/p&gt;\r\n\r\n&lt;p&gt;Салон свадебных платьев &quot;Ксена&quot; предлагает Вам шикарные свадебные платья, в которых Вы будете выглядеть и чувствовать себя неотразимой и самой прекрасной.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('65', '4', 'Lolita', '&lt;p&gt;Кожна наречена мріє в день весілля виглядати неповторно і чарівно. Ексклюзивні весільні сукні від салону &quot;Ксена&quot; - Ваш головний помічник у цьому.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весільна сукня на замовлення моделі &quot;Lolita&quot; - Ваша можливість відчути себе казковою героїнею, чарівною німфою, яка одним видом може закрутити голову.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ця весільна&amp;nbsp;сукня&amp;nbsp;на замовлення поєднує в собі витонченість і екстравагантність завдяки своїй оригінальній формі - «рибка» або «русалка». Такий вінчальний наряд - вибір сміливих наречених, які хочуть запам\'ятатися всім гостям і отримати незліченну кількість захоплених поглядів і компліментів.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх сукні являє собою подовжений до колін, приталений корсет, який прекрасно підкреслює витонченість фігури. Від колін починається пишна широка спідниця.&lt;/p&gt;\r\n\r\n&lt;p&gt;Весь корсет, низ і верх спідниці прикрашені кордових мереживом вручну розшитим бісером і паєтками. Красива форма ліфа - сердечко вигідно підкреслює груди.&lt;/p&gt;\r\n\r\n&lt;p&gt;Верх і рукава виконані з тонкої сітки і задекоровані&amp;nbsp;мереживом з додаванням бісеру та паєток. Практично повністю оголена, прикрита тільки тонким&amp;nbsp;серпанком сітки і вигадливим малюнком мережива спинка додає сукні особливого шику, пишноти і королівської величі.&lt;/p&gt;\r\n\r\n&lt;p&gt;Салон весільних суконь &quot;Ксена&quot; пропонує Вам шикарні весільні сукні, в яких Ви будете виглядати і відчувати себе чарівною і найпрекраснішою.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('65', '3', 'Lolita', '&lt;p&gt;Jede Braut träumt zu sehen unnachahmlich und Fee an einem Hochzeitstag. Exklusive Brautkleider, die Hochzeitssalon bietet «Ksena» - ist Ihr Haupt-Assistent in ihm.&lt;/p&gt;\r\n\r\n&lt;p&gt;Nach Maß Hochzeitskleid Lolita - ist Ihre Gelegenheit, sich wie eine verträumte Heldin zu fühlen, reizend Nymphe, die gerade durch ihr Aussehen zum Kopf gehen kann.&lt;/p&gt;\r\n\r\n&lt;p&gt;Dieses maßgeschneiderte Kleid kombiniert Raffinesse und Extravaganz aufgrund seiner ursprünglichen Form - «Meerjungfrau». Solche Hochzeitskleidung ist eine Wahl der mutigen Bestechungsgelder, die von den Gästen erinnert werden möchten und erhalten eine unzählige Menge von begeisterten Blicken und Komplimente.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Spitze des Kleides präsentiert eine langgestreckte bis die Knie, eng anliegend in der Taille Korsett, das Eleganz und Zartheit der Figur betont. Von den Knien beginnt ein voller breiter Rock.&lt;/p&gt;\r\n\r\n&lt;p&gt;Das ganze Korsett, die Unterseite und die Oberseite des Rockes werden mit Schnurspitze verziert, die handgemachtes ist, das mit Kornen und Pailletten gestickt wird. Eine schöne Form des Mieders - ein Herz - gewinnbringend belastet die Brust der Frau.&lt;/p&gt;\r\n\r\n&lt;p&gt;Die Oberseite und die Hülsen werden vom dünnen Netz gebildet, das mit Spitze einschließlich der Zusatz der Korne und der Pailletten verziert wird. Fast kahl, nur mit dünnen Netz Dunst bedeckt und daedal Spitzenmuster zurück gibt dem Kleid einen besonderen Chic, Pracht und königliche Größe.&lt;/p&gt;\r\n\r\n&lt;p&gt;Der Hochzeitssalon «Ksena» bietet Ihnen posh Brautkleider, die Sie sehen und fühlen unwiderstehlich und schön.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `ocksena_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`) VALUES ('65', '1', 'Lolita', '&lt;p&gt;Every bride dreams to look inimitable and fairy on a wedding day. Exclusive wedding dresses that offers wedding salon «Ksena» - is Your main assistant in it.&lt;/p&gt;\r\n\r\n&lt;p&gt;Made-to-order wedding dress Lolita – is Your opportunity to feel yourself like a dreamy heroine, charming nymph, who just by her appearance can go to the head.&lt;/p&gt;\r\n\r\n&lt;p&gt;This tailored dress combines refinement and extravagancy due to its original form – «mermaid». Such wedding attire is a choice of brave bribes, who want to be remembered by guests and get a countless amount of rapturous gazes and compliments.&lt;/p&gt;\r\n\r\n&lt;p&gt;The top of the dress presents an elongated to the knees, close-fitting in the waist corset that emphasizes elegance and delicacy of the figure. Of knees a full wide skirt begins.&lt;/p&gt;\r\n\r\n&lt;p&gt;The whole corset, the bottom and the top of the skirt are decorated with cord lace that is handmade embroidered with beads and sequins. A beautiful shape of the bodice – a heart – profitably lays stress on woman’s breast.&lt;/p&gt;\r\n\r\n&lt;p&gt;The top and sleeves are made of thin netting decorated with lace including the addition of the beads and sequins. Almost bare, covered just with thin netting’s haze and daedal lace’s pattern back gives the dress a special chic, magnificence and royal greatness.&lt;/p&gt;\r\n\r\n&lt;p&gt;The wedding salon «Ksena» offers You posh wedding gowns that will make You look and feel irresistible and beautiful.&lt;/p&gt;\r\n', '', '', '');
